INSERT INTO `j_goods` VALUES ('8', '商品名称测试', 'KHJLKHLKU', '短标题', '品牌', '12.88', '38.99', 'JKHKJH', '2016-08-25 11:48:30', '/geekdol/geekstore/upload/image/20160825/5b7e03b1-54d8-41e9-82d1-c00e7cdb0981.jpg', '<p>原标题：韩欲再扩战力：韩媒宣称“萨德”功能不全 欲购宙斯盾舰</p><p>　　【环球网报道 记者 魏悦】据韩国《中央日报》8月23日报道，对于朝鲜持有最多的飞毛腿和芦洞导弹的普通发射，可以用爱国者导弹和末段高空区域防御系统(THAAD，萨德)进行拦截。但若用高角度发射，则将会脱离“萨德”的最大拦截高度150公里，由此难以拦截。因此若朝鲜在弹道导弹上搭载核弹头进行高角度发射，这对韩军来说将会是致命的打击。</p><p>　　韩国情报当局22日称，预计朝鲜将在三四年内实战部署搭载核弹头的高空弹道导弹。但韩军当局现在对此尚无适当对策。而韩国计划从2023年开始引进拥有高空拦截功能的新一代宙斯盾舰。</p><p>　　韩国海军和美国军工企业洛克希德·马丁公司称，决定在新一代宙斯盾舰上搭载可运用高空拦截导弹“SM-3”的最新型宙斯盾体系“Baseline 9”。因此，朝鲜实战部署安装核的弹道导弹的时期要比韩国引进宙斯盾舰早三年左右。也就是说，在这三年间，韩国的防御战力会出现空白。</p><p>　　此外，朝鲜已改变了弹道导弹战略，但韩军的应对政策却依然保持原样。韩国联合参谋本部的弹道导弹防御概念是根据朝鲜飞毛腿导弹(射程340公里)制定的“末端下层防御”。这是在导弹在达到最高高度下降后接近地面时进行拦截的战略。如果使用该战略，韩军可以持有的弹道导弹拦截系统有爱国者导弹和正在开发的L-SAM(最高拦截高度60公里)。其中防御最高高度为500公里的SM-3除外。</p><p>　　但朝鲜可以以250公里以上的高度发射芦洞(射程1300公里)导弹和舞水端(3500公里)导弹。用根据下层防御概念的低高度(六七十公里以下)拦截导弹很难防御。但韩军依然推出下层防御，固执地坚称“没有计划引进可进行高度防御的SM-3导弹”。</p><p>　　据悉，朝鲜今年分13次发射了29发导弹。其中部分芦洞和舞水端导弹发射表现出与现有导弹战略不同的情况。与一般发射模式不同，朝鲜有意提高发射角度进行了高角度发射。舞水端导弹高度上升至1413公里(朝鲜发布)，芦洞导弹的发射高度提高了250公里以上。</p><p>原标题：韩欲再扩战力：韩媒宣称“萨德”功能不全 欲购宙斯盾舰</p><p>　　【环球网报道 记者 魏悦】据韩国《中央日报》8月23日报道，对于朝鲜持有最多的飞毛腿和芦洞导弹的普通发射，可以用爱国者导弹和末段高空区域防御系统(THAAD，萨德)进行拦截。但若用高角度发射，则将会脱离“萨德”的最大拦截高度150公里，由此难以拦截。因此若朝鲜在弹道导弹上搭载核弹头进行高角度发射，这对韩军来说将会是致命的打击。</p><p>　　韩国情报当局22日称，预计朝鲜将在三四年内实战部署搭载核弹头的高空弹道导弹。但韩军当局现在对此尚无适当对策。而韩国计划从2023年开始引进拥有高空拦截功能的新一代宙斯盾舰。</p><p>　　韩国海军和美国军工企业洛克希德·马丁公司称，决定在新一代宙斯盾舰上搭载可运用高空拦截导弹“SM-3”的最新型宙斯盾体系“Baseline 9”。因此，朝鲜实战部署安装核的弹道导弹的时期要比韩国引进宙斯盾舰早三年左右。也就是说，在这三年间，韩国的防御战力会出现空白。</p><p>　　此外，朝鲜已改变了弹道导弹战略，但韩军的应对政策却依然保持原样。韩国联合参谋本部的弹道导弹防御概念是根据朝鲜飞毛腿导弹(射程340公里)制定的“末端下层防御”。这是在导弹在达到最高高度下降后接近地面时进行拦截的战略。如果使用该战略，韩军可以持有的弹道导弹拦截系统有爱国者导弹和正在开发的L-SAM(最高拦截高度60公里)。其中防御最高高度为500公里的SM-3除外。</p><p>　　但朝鲜可以以250公里以上的高度发射芦洞(射程1300公里)导弹和舞水端(3500公里)导弹。用根据下层防御概念的低高度(六七十公里以下)拦截导弹很难防御。但韩军依然推出下层防御，固执地坚称“没有计划引进可进行高度防御的SM-3导弹”。</p><p>　　据悉，朝鲜今年分13次发射了29发导弹。其中部分芦洞和舞水端导弹发射表现出与现有导弹战略不同的情况。与一般发射模式不同，朝鲜有意提高发射角度进行了高角度发射。舞水端导弹高度上升至1413公里(朝鲜发布)，芦洞导弹的发射高度提高了250公里以上。', '1', null, '03', '1', '2016-08-25 11:48:46', '1', '2016-09-06 11:56:10', '4', '0');
