INSERT INTO `j_groupon_goods` VALUES ('9', 'TGBM', '0', '团购名称1', '副标题副标题副标题副标题副标题', '120', '46', '489.86', '389.86', '76.98', '<p>创建JSONArray的常用四种方法 &nbsp;<br/><br/>1.从头或者从零开始，创建一个JSONArray(Creating a JSONArray from scratch) &nbsp;<br/>实例1： &nbsp;<br/><br/><br/>Java代码&nbsp; &nbsp;<br/>JSONArray jsonArray = new JSONArray().element(&quot;JSON&quot;).element(&quot;1&quot;).element(&quot;2.0&quot;).element(&quot;true&quot;);&nbsp;&nbsp; &nbsp;<br/>assertEquals(&quot;JSON&quot;, jsonArray.getString(0));&nbsp;&nbsp; &nbsp;<br/>assertEquals(1, jsonArray.getInt(1));&nbsp;&nbsp; &nbsp;<br/>assertEquals(2.0d, jsonArray.getDouble(2), 0d);&nbsp;&nbsp; &nbsp;<br/>assertTrue(jsonArray.getBoolean(3));&nbsp;&nbsp; &nbsp;<br/><br/><br/>3.使用一个Collection来创建一个JSONArray(Creating a JSONArray from a Collection) &nbsp;<br/>实例1： &nbsp;<br/><br/>Java代码&nbsp; &nbsp;<br/>List list = new ArrayList();&nbsp; &nbsp;<br/> list.add( &quot;JSON&quot; );&nbsp;&nbsp; &nbsp;<br/>list.add( &quot;1&quot; );&nbsp;&nbsp; &nbsp;<br/>list.add( &quot;2.0&quot; );&nbsp;&nbsp; &nbsp;<br/>list.add( &quot;true&quot; );&nbsp;&nbsp; &nbsp;<br/>JSONArray jsonArray = (JSONArray) JSONSerializer.toJSON( list ); assertEquals( &quot;JSON&quot;, jsonArray.getString(0) );&nbsp;&nbsp; &nbsp;<br/>assertEquals( 1, jsonArray.getInt(1) );&nbsp;&nbsp; &nbsp;<br/>assertEquals( 2.0d, jsonArray.getDouble(2), 0d );&nbsp;&nbsp; &nbsp;<br/>assertTrue( jsonArray.getBoolean(3) );&nbsp;&nbsp; &nbsp;<br/><br/><br/>4.使用一个Array来创建一个JSONArray(Creating a JSONArray from an array) &nbsp;<br/>实例1： &nbsp;<br/><br/>Java代码&nbsp; &nbsp;<br/>Object[] array = new Object[] { &quot;JSON&quot;, 1, 2.0, true };&nbsp;&nbsp; &nbsp;<br/>JSONArray jsonArray = (JSONArray) JSONSerializer.toJSON(array); assertEquals(&quot;JSON&quot;, jsonArray.getString(0));&nbsp; &nbsp;<br/>assertEquals(1, jsonArray.getInt(1));&nbsp;&nbsp; &nbsp;<br/>assertEquals(2.0d, jsonArray.getDouble(2), 0d);&nbsp;&nbsp; &nbsp;<br/>assertTrue(jsonArray.getBoolean(3));&nbsp;&nbsp; &nbsp;<br/>&nbsp; &nbsp;<br/>//实例2：&nbsp;&nbsp; &nbsp;<br/>Object[] array = new Object[] { &quot;JSON&quot;, 1, 2.0, true };&nbsp;&nbsp; &nbsp;<br/>JSONArray jsonArray = JSONArray.fromObject(array);&nbsp;&nbsp; &nbsp;<br/>assertEquals(&quot;JSON&quot;, jsonArray.getString(0));&nbsp;&nbsp; &nbsp;<br/>assertEquals(1, jsonArray.getInt(1));&nbsp;&nbsp; &nbsp;<br/>assertEquals(2.0d, jsonArray.getDouble(2), 0d);&nbsp;&nbsp; &nbsp;<br/>assertTrue(jsonArray.getBoolean(3));&nbsp;&nbsp; &nbsp;<br/><br/><br/>由此可见，无论要转换的源是哪种类型，都可以使用(JSONArray) JSONSerializer.toJSON()或JSONArray.fromObject()来转换; &nbsp;<br/><br/>常用的三种扩展功能 &nbsp;<br/><br/>1.使用一个JSON格式化字符串来创建一个JSONFunction(JavaScript functions)&nbsp; &nbsp;<br/>实例： &nbsp;<br/><br/>Java代码&nbsp; &nbsp;<br/>String str = &quot;{func: function( param ){ doSomethingWithParam(param); }}&quot;;&nbsp;&nbsp; &nbsp;<br/>JSONObject jsonObject = (JSONObject) JSONSerializer.toJSON(str); JSONFunction func = (JSONFunction) jsonObject.get(&quot;func&quot;); ArrayAssertions.assertEquals(new String[] { &quot;param&quot; }, func.getParams());&nbsp;&nbsp; &nbsp;<br/>assertEquals(&quot;doSomethingWithParam(param);&quot;, func.getText());&nbsp;&nbsp; &nbsp;<br/><br/>&nbsp; &nbsp;<br/>注：函数的写法要注意function(){},参数param是可选的！ &nbsp;<br/><br/>2.排除一个JSON格式化字符串的某些属性(Exclude properties) &nbsp;<br/>实例： &nbsp;<br/><br/>Java代码&nbsp; &nbsp;<br/>String str = &quot;{&#39;string&#39;:&#39;JSON&#39;, &#39;integer&#39;: 1, &#39;double&#39;: 2.0, &#39;boolean&#39;: true}&quot;;&nbsp;&nbsp; &nbsp;<br/>JsonConfig jsonConfig = new JsonConfig();&nbsp;&nbsp; &nbsp;<br/>jsonConfig.setExcludes(new String[] { &quot;double&quot;, &quot;boolean&quot; }); JSONObject jsonObject = (JSONObject) JSONSerializer.toJSON(str, jsonConfig);&nbsp;&nbsp; &nbsp;<br/>assertEquals(&quot;JSON&quot;, jsonObject.getString(&quot;string&quot;));&nbsp;&nbsp; &nbsp;<br/>assertEquals(1, jsonObject.getInt(&quot;integer&quot;));&nbsp; &nbsp;<br/>assertFalse(jsonObject.has(&quot;double&quot;));&nbsp;&nbsp; &nbsp;<br/>assertFalse(jsonObject.has(&quot;boolean&quot;));&nbsp;&nbsp; &nbsp;<br/><br/><br/>3.排除一个JSON格式化字符串的某些属性,使用过滤器(Exclude properties (with filters) &nbsp;<br/>实例： &nbsp;<br/>Java代码&nbsp; &nbsp;<br/>String str = &quot;{&#39;string&#39;:&#39;JSON&#39;, &#39;integer&#39;: 1, &#39;double&#39;: 2.0, &#39;boolean&#39;: true}&quot;;&nbsp; &nbsp;<br/> JsonConfig jsonConfig = new JsonConfig(); jsonConfig.setJsonPropertyFilter(new PropertyFilter() {&nbsp;&nbsp; &nbsp;<br/>&nbsp;&nbsp; public boolean apply(Object source, String name, Object value) {&nbsp; &nbsp;<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; if (&quot;double&quot;.equals(name) || &quot;boolean&quot;.equals(name))&nbsp;&nbsp; &nbsp;<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; { return true; }&nbsp; &nbsp;<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; return false; } });&nbsp;&nbsp; &nbsp;<br/>JSONObject jsonObject = (JSONObject) JSONSerializer.toJSON(str, jsonConfig);&nbsp;&nbsp; &nbsp;<br/>assertEquals(&quot;JSON&quot;, jsonObject.getString(&quot;string&quot;));&nbsp;&nbsp; &nbsp;<br/>assertEquals(1, jsonObject.getInt(&quot;integer&quot;));&nbsp;&nbsp; &nbsp;<br/>assertFalse(jsonObject.has(&quot;double&quot;));&nbsp;&nbsp; &nbsp;<br/>assertFalse(jsonObject.has(&quot;boolean&quot;));&nbsp;&nbsp; &nbsp;<br/><br/><br/>JSONObject-Java常用的四种用法 &nbsp;<br/>1.JSONObject to DynaBean &nbsp;<br/><br/>Java代码&nbsp; &nbsp;<br/>String json = &quot;{name=\\&quot;json\\&quot;,bool:true,int:1,double:2.2}&quot;; JSONObject jsonObject = JSONObject.fromObject(json); //抽象的写法：DynaBean bean = (DynaBean) JSONSerializer.toJava( jsonObject ); Object bean = JSONObject.toBean(jsonObject);&nbsp;&nbsp; &nbsp;<br/>//Object bean1 = JSONSerializer.toJava(jsonObject);&nbsp;&nbsp; &nbsp;<br/>assertEquals(jsonObject.get(&quot;name&quot;), PropertyUtils.getProperty(bean, &quot;name&quot;));&nbsp; &nbsp;<br/> assertEquals(jsonObject.get(&quot;bool&quot;), PropertyUtils.getProperty(bean, &quot;bool&quot;));&nbsp;&nbsp; &nbsp;<br/>assertEquals(jsonObject.get(&quot;int&quot;), PropertyUtils.getProperty(bean, &quot;int&quot;));&nbsp;&nbsp; &nbsp;<br/>assertEquals(jsonObject.get(&quot;double&quot;), PropertyUtils.getProperty(bean, &quot;double&quot;));&nbsp;&nbsp; &nbsp;<br/><br/><br/>2.JSONObject to JavaBean &nbsp;<br/><br/>Java代码&nbsp; &nbsp;<br/>String json = &quot;{name:\\&quot;zhangsan\\&quot;,age:25,hight:1.72,sex:true}&quot;; JSONObject jsonObject = JSONObject.fromObject(json);&nbsp;&nbsp; &nbsp;<br/>UserBean bean = (UserBean) JSONObject.toBean(jsonObject, UserBean.class);&nbsp;&nbsp; &nbsp;<br/>System.out.println(jsonObject);&nbsp;&nbsp; &nbsp;<br/><br/><br/>3.JSONArray to List &nbsp;<br/><br/>Java代码&nbsp; &nbsp;<br/>String json = &quot;[\\&quot;first\\&quot;,\\&quot;second\\&quot;]&quot;;&nbsp;&nbsp; &nbsp;<br/>JSONArray jsonArray = (JSONArray) JSONSerializer.toJSON(json);&nbsp; &nbsp;<br/> List output = (List) JSONSerializer.toJava(jsonArray);&nbsp;&nbsp; &nbsp;<br/><br/><br/>4.JSONArray to array &nbsp;<br/><br/>Java代码&nbsp; &nbsp;<br/>String json = &quot;[\\&quot;first\\&quot;,\\&quot;second\\&quot;]&quot;;&nbsp; &nbsp;<br/> JSONArray jsonArray = (JSONArray) JSONSerializer.toJSON(json); JsonConfig jsonConfig = new JsonConfig();&nbsp;&nbsp; &nbsp;<br/>jsonConfig.setArrayMode(JsonConfig.MODE_OBJECT_ARRAY);&nbsp;&nbsp; &nbsp;<br/>Object[] output = (Object[]) JSONSerializer.toJava(jsonArray, jsonConfig);&nbsp;&nbsp; &nbsp;<br/>Object[] expected = new Object[] { &quot;first&quot;, &quot;second&quot; }; ArrayAssertions.assertEquals(expected, output);&nbsp;&nbsp;&nbsp; &nbsp;<br/><br/><br/>理论上，这样就可以了，但时，有异常Caused by: java.lang.NoSuchMethodException: com.json.Json$UserBean.&lt;init&gt;() &nbsp;<br/>&nbsp;&nbsp; &nbsp;<br/>2.使用一个JSON格式化字符串来创建一个JSONArray(Creating a JSONArray from a JSON formatted string)&nbsp; &nbsp;<br/>实例1： &nbsp;<br/><br/>Java代码&nbsp; &nbsp;<br/>String str = &quot;[&#39;JSON&#39;, 1, 2.0, true]&quot;; //注意该字符串的格式&quot;[ , ]&quot; JSONArray jsonArray = (JSONArray) JSONSerializer.toJSON( str ); assertEquals( &quot;JSON&quot;, jsonArray.getString(0) );&nbsp;&nbsp; &nbsp;<br/>assertEquals( 1, jsonArray.getInt(1) );&nbsp;&nbsp; &nbsp;<br/>assertEquals( 2.0d, jsonArray.getDouble(2), 0d );&nbsp;&nbsp; &nbsp;<br/>assertTrue( jsonArray.getBoolean(3) );&nbsp;&nbsp; &nbsp;<br/><br/><br/>Java代码&nbsp; &nbsp;<br/>List&lt;String&gt; list = new ArryList&lt;String&gt;(); list.add(&quot;a&quot;); list.add(&quot;b&quot;); Map&lt;String,List&lt;String&gt;&gt; map = new HashMap&lt;String,List&lt;String&gt;&gt;(); map.put(&quot;list&quot;,list); MessageUtils.outputJSONResult(JSONObject.fromObject(map).toString(), response); public class MessageUtils { public static void outputJSONResult(String result, HttpServletResponse response) { try { response.setHeader(&quot;ContentType&quot;, &quot;text/json&quot;); response.setCharacterEncoding(&quot;utf-8&quot;); PrintWriter pw = response.getWriter(); pw.write(result); pw.flush(); pw.close(); } catch (IOException e) { e.printStackTrace(); } } &nbsp;</p>', '01', '2016-08-08 18:56:02', '2016-12-29 18:56:03', '1', '02', null, '0', '0', '0', '0', '0', '0', '1', '2016-08-08 18:59:05', '1', '2016-08-08 18:59:05', '7', '0');
INSERT INTO `j_groupon_goods` VALUES ('10', 'DDFFRFR', '0', '团购名称2', '副标题', '120', '68', '489.00', '389.00', '147.00', '<p>创建JSONArray的常用四种方法 &nbsp;<br/><br/>1.从头或者从零开始，创建一个JSONArray(Creating a JSONArray from scratch) &nbsp;<br/>实例1： &nbsp;<br/><br/><br/>Java代码&nbsp; &nbsp;<br/>JSONArray jsonArray = new JSONArray().element(&quot;JSON&quot;).element(&quot;1&quot;).element(&quot;2.0&quot;).element(&quot;true&quot;);&nbsp;&nbsp; &nbsp;<br/>assertEquals(&quot;JSON&quot;, jsonArray.getString(0));&nbsp;&nbsp; &nbsp;<br/>assertEquals(1, jsonArray.getInt(1));&nbsp;&nbsp; &nbsp;<br/>assertEquals(2.0d, jsonArray.getDouble(2), 0d);&nbsp;&nbsp; &nbsp;<br/>assertTrue(jsonArray.getBoolean(3));&nbsp;&nbsp; &nbsp;<br/><br/><br/>3.使用一个Collection来创建一个JSONArray(Creating a JSONArray from a Collection) &nbsp;<br/>实例1： &nbsp;<br/><br/>Java代码&nbsp; &nbsp;<br/>List list = new ArrayList();&nbsp; &nbsp;<br/> list.add( &quot;JSON&quot; );&nbsp;&nbsp; &nbsp;<br/>list.add( &quot;1&quot; );&nbsp;&nbsp; &nbsp;<br/>list.add( &quot;2.0&quot; );&nbsp;&nbsp; &nbsp;<br/>list.add( &quot;true&quot; );&nbsp;&nbsp; &nbsp;<br/>JSONArray jsonArray = (JSONArray) JSONSerializer.toJSON( list ); assertEquals( &quot;JSON&quot;, jsonArray.getString(0) );&nbsp;&nbsp; &nbsp;<br/>assertEquals( 1, jsonArray.getInt(1) );&nbsp;&nbsp; &nbsp;<br/>assertEquals( 2.0d, jsonArray.getDouble(2), 0d );&nbsp;&nbsp; &nbsp;<br/>assertTrue( jsonArray.getBoolean(3) );&nbsp;&nbsp; &nbsp;<br/><br/><br/>4.使用一个Array来创建一个JSONArray(Creating a JSONArray from an array) &nbsp;<br/>实例1： &nbsp;<br/><br/>Java代码&nbsp; &nbsp;<br/>Object[] array = new Object[] { &quot;JSON&quot;, 1, 2.0, true };&nbsp;&nbsp; &nbsp;<br/>JSONArray jsonArray = (JSONArray) JSONSerializer.toJSON(array); assertEquals(&quot;JSON&quot;, jsonArray.getString(0));&nbsp; &nbsp;<br/>assertEquals(1, jsonArray.getInt(1));&nbsp;&nbsp; &nbsp;<br/>assertEquals(2.0d, jsonArray.getDouble(2), 0d);&nbsp;&nbsp; &nbsp;<br/>assertTrue(jsonArray.getBoolean(3));&nbsp;&nbsp; &nbsp;<br/>&nbsp; &nbsp;<br/>//实例2：&nbsp;&nbsp; &nbsp;<br/>Object[] array = new Object[] { &quot;JSON&quot;, 1, 2.0, true };&nbsp;&nbsp; &nbsp;<br/>JSONArray jsonArray = JSONArray.fromObject(array);&nbsp;&nbsp; &nbsp;<br/>assertEquals(&quot;JSON&quot;, jsonArray.getString(0));&nbsp;&nbsp; &nbsp;<br/>assertEquals(1, jsonArray.getInt(1));&nbsp;&nbsp; &nbsp;<br/>assertEquals(2.0d, jsonArray.getDouble(2), 0d);&nbsp;&nbsp; &nbsp;<br/>assertTrue(jsonArray.getBoolean(3));&nbsp;&nbsp; &nbsp;<br/><br/><br/>由此可见，无论要转换的源是哪种类型，都可以使用(JSONArray) JSONSerializer.toJSON()或JSONArray.fromObject()来转换; &nbsp;<br/><br/>常用的三种扩展功能 &nbsp;<br/><br/>1.使用一个JSON格式化字符串来创建一个JSONFunction(JavaScript functions)&nbsp; &nbsp;<br/>实例： &nbsp;<br/><br/>Java代码&nbsp; &nbsp;<br/>String str = &quot;{func: function( param ){ doSomethingWithParam(param); }}&quot;;&nbsp;&nbsp; &nbsp;<br/>JSONObject jsonObject = (JSONObject) JSONSerializer.toJSON(str); JSONFunction func = (JSONFunction) jsonObject.get(&quot;func&quot;); ArrayAssertions.assertEquals(new String[] { &quot;param&quot; }, func.getParams());&nbsp;&nbsp; &nbsp;<br/>assertEquals(&quot;doSomethingWithParam(param);&quot;, func.getText());&nbsp;&nbsp; &nbsp;<br/><br/>&nbsp; &nbsp;<br/>注：函数的写法要注意function(){},参数param是可选的！ &nbsp;<br/><br/>2.排除一个JSON格式化字符串的某些属性(Exclude properties) &nbsp;<br/>实例： &nbsp;<br/><br/>Java代码&nbsp; &nbsp;<br/>String str = &quot;{&#39;string&#39;:&#39;JSON&#39;, &#39;integer&#39;: 1, &#39;double&#39;: 2.0, &#39;boolean&#39;: true}&quot;;&nbsp;&nbsp; &nbsp;<br/>JsonConfig jsonConfig = new JsonConfig();&nbsp;&nbsp; &nbsp;<br/>jsonConfig.setExcludes(new String[] { &quot;double&quot;, &quot;boolean&quot; }); JSONObject jsonObject = (JSONObject) JSONSerializer.toJSON(str, jsonConfig);&nbsp;&nbsp; &nbsp;<br/>assertEquals(&quot;JSON&quot;, jsonObject.getString(&quot;string&quot;));&nbsp;&nbsp; &nbsp;<br/>assertEquals(1, jsonObject.getInt(&quot;integer&quot;));&nbsp; &nbsp;<br/>assertFalse(jsonObject.has(&quot;double&quot;));&nbsp;&nbsp; &nbsp;<br/>assertFalse(jsonObject.has(&quot;boolean&quot;));&nbsp;&nbsp; &nbsp;<br/><br/><br/>3.排除一个JSON格式化字符串的某些属性,使用过滤器(Exclude properties (with filters) &nbsp;<br/>实例： &nbsp;<br/>Java代码&nbsp; &nbsp;<br/>String str = &quot;{&#39;string&#39;:&#39;JSON&#39;, &#39;integer&#39;: 1, &#39;double&#39;: 2.0, &#39;boolean&#39;: true}&quot;;&nbsp; &nbsp;<br/> JsonConfig jsonConfig = new JsonConfig(); jsonConfig.setJsonPropertyFilter(new PropertyFilter() {&nbsp;&nbsp; &nbsp;<br/>&nbsp;&nbsp; public boolean apply(Object source, String name, Object value) {&nbsp; &nbsp;<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; if (&quot;double&quot;.equals(name) || &quot;boolean&quot;.equals(name))&nbsp;&nbsp; &nbsp;<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; { return true; }&nbsp; &nbsp;<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; return false; } });&nbsp;&nbsp; &nbsp;<br/>JSONObject jsonObject = (JSONObject) JSONSerializer.toJSON(str, jsonConfig);&nbsp;&nbsp; &nbsp;<br/>assertEquals(&quot;JSON&quot;, jsonObject.getString(&quot;string&quot;));&nbsp;&nbsp; &nbsp;<br/>assertEquals(1, jsonObject.getInt(&quot;integer&quot;));&nbsp;&nbsp; &nbsp;<br/>assertFalse(jsonObject.has(&quot;double&quot;));&nbsp;&nbsp; &nbsp;<br/>assertFalse(jsonObject.has(&quot;boolean&quot;));&nbsp;&nbsp; &nbsp;<br/><br/><br/>JSONObject-Java常用的四种用法 &nbsp;<br/>1.JSONObject to DynaBean &nbsp;<br/><br/>Java代码&nbsp; &nbsp;<br/>String json = &quot;{name=\\&quot;json\\&quot;,bool:true,int:1,double:2.2}&quot;; JSONObject jsonObject = JSONObject.fromObject(json); //抽象的写法：DynaBean bean = (DynaBean) JSONSerializer.toJava( jsonObject ); Object bean = JSONObject.toBean(jsonObject);&nbsp;&nbsp; &nbsp;<br/>//Object bean1 = JSONSerializer.toJava(jsonObject);&nbsp;&nbsp; &nbsp;<br/>assertEquals(jsonObject.get(&quot;name&quot;), PropertyUtils.getProperty(bean, &quot;name&quot;));&nbsp; &nbsp;<br/> assertEquals(jsonObject.get(&quot;bool&quot;), PropertyUtils.getProperty(bean, &quot;bool&quot;));&nbsp;&nbsp; &nbsp;<br/>assertEquals(jsonObject.get(&quot;int&quot;), PropertyUtils.getProperty(bean, &quot;int&quot;));&nbsp;&nbsp; &nbsp;<br/>assertEquals(jsonObject.get(&quot;double&quot;), PropertyUtils.getProperty(bean, &quot;double&quot;));&nbsp;&nbsp; &nbsp;<br/><br/><br/>2.JSONObject to JavaBean &nbsp;<br/><br/>Java代码&nbsp; &nbsp;<br/>String json = &quot;{name:\\&quot;zhangsan\\&quot;,age:25,hight:1.72,sex:true}&quot;; JSONObject jsonObject = JSONObject.fromObject(json);&nbsp;&nbsp; &nbsp;<br/>UserBean bean = (UserBean) JSONObject.toBean(jsonObject, UserBean.class);&nbsp;&nbsp; &nbsp;<br/>System.out.println(jsonObject);&nbsp;&nbsp; &nbsp;<br/><br/><br/>3.JSONArray to List &nbsp;<br/><br/>Java代码&nbsp; &nbsp;<br/>String json = &quot;[\\&quot;first\\&quot;,\\&quot;second\\&quot;]&quot;;&nbsp;&nbsp; &nbsp;<br/>JSONArray jsonArray = (JSONArray) JSONSerializer.toJSON(json);&nbsp; &nbsp;<br/> List output = (List) JSONSerializer.toJava(jsonArray);&nbsp;&nbsp; &nbsp;<br/><br/><br/>4.JSONArray to array &nbsp;<br/><br/>Java代码&nbsp; &nbsp;<br/>String json = &quot;[\\&quot;first\\&quot;,\\&quot;second\\&quot;]&quot;;&nbsp; &nbsp;<br/> JSONArray jsonArray = (JSONArray) JSONSerializer.toJSON(json); JsonConfig jsonConfig = new JsonConfig();&nbsp;&nbsp; &nbsp;<br/>jsonConfig.setArrayMode(JsonConfig.MODE_OBJECT_ARRAY);&nbsp;&nbsp; &nbsp;<br/>Object[] output = (Object[]) JSONSerializer.toJava(jsonArray, jsonConfig);&nbsp;&nbsp; &nbsp;<br/>Object[] expected = new Object[] { &quot;first&quot;, &quot;second&quot; }; ArrayAssertions.assertEquals(expected, output);&nbsp;&nbsp;&nbsp; &nbsp;<br/><br/><br/>理论上，这样就可以了，但时，有异常Caused by: java.lang.NoSuchMethodException: com.json.Json$UserBean.&lt;init&gt;() &nbsp;<br/>&nbsp;&nbsp; &nbsp;<br/>2.使用一个JSON格式化字符串来创建一个JSONArray(Creating a JSONArray from a JSON formatted string)&nbsp; &nbsp;<br/>实例1： &nbsp;<br/><br/>Java代码&nbsp; &nbsp;<br/>String str = &quot;[&#39;JSON&#39;, 1, 2.0, true]&quot;; //注意该字符串的格式&quot;[ , ]&quot; JSONArray jsonArray = (JSONArray) JSONSerializer.toJSON( str ); assertEquals( &quot;JSON&quot;, jsonArray.getString(0) );&nbsp;&nbsp; &nbsp;<br/>assertEquals( 1, jsonArray.getInt(1) );&nbsp;&nbsp; &nbsp;<br/>assertEquals( 2.0d, jsonArray.getDouble(2), 0d );&nbsp;&nbsp; &nbsp;<br/>assertTrue( jsonArray.getBoolean(3) );&nbsp;&nbsp; &nbsp;<br/><br/><br/>Java代码&nbsp; &nbsp;<br/>List&lt;String&gt; list = new ArryList&lt;String&gt;(); list.add(&quot;a&quot;); list.add(&quot;b&quot;); Map&lt;String,List&lt;String&gt;&gt; map = new HashMap&lt;String,List&lt;String&gt;&gt;(); map.put(&quot;list&quot;,list); MessageUtils.outputJSONResult(JSONObject.fromObject(map).toString(), response); public class MessageUtils { public static void outputJSONResult(String result, HttpServletResponse response) { try { response.setHeader(&quot;ContentType&quot;, &quot;text/json&quot;); response.setCharacterEncoding(&quot;utf-8&quot;); PrintWriter pw = response.getWriter(); pw.write(result); pw.flush(); pw.close(); } catch (IOException e) { e.printStackTrace(); } } &nbsp;</p>', '01', '2016-08-08 19:11:29', '2017-01-31 19:11:31', '1', '02', null, '0', '0', '0', '0', '0', '0', '1', '2016-08-08 19:13:17', '1', '2016-08-22 18:15:59', '8', '0');
