INSERT INTO `m_activity_collection` VALUES ('9', '测试中', '测试中', '/geekdol/hmedia/upload/image/20160808/7d86cdfd-05bf-4fce-9a11-d371fe7f74be.png', '2016-08-08 16:05:10', '2016-08-08 16:05:11', '1', '10', '2016-08-08 16:05:13', '<p>报道称，中国游客在圣彼得堡大肆采购伏特加、巧克力、套娃和琥珀。中国人对琥珀赞叹不已，认为它沉淀了历史。不少中国游客都愿意排几个小时的队，只\r\n为进入皇村的琥珀宫一睹风采。有些中国导游“言之凿凿”地说，俄罗斯历史上的很多战争起因都是琥珀！比如，彼得一世发动北方战争，就是为了夺取波罗的海的\r\n琥珀储备；琥珀也是二战爆发的原因；中国游客代表曾经向普京请求不要实施琥珀限购，然后总统同意了！（编译/朱丽峰）<img alt=\"1472009435801056424.png\" src=\"/geekdol/hmedia/upload/image/20160824/1472009435801056424.png\" title=\"1472009435801056424.png\" height=\"50\" width=\"50\"/></p><p><video class=\"edui-upload-video  vjs-default-skin video-js\" controls=\"controls\" preload=\"none\" width=\"420\" height=\"280\" src=\"/geekdol/hmedia/upload/video/20160824/1472009483391001106.mp4\" data-setup=\"{}\"></video></p>', '0', '2016-08-08 16:05:17', '2016-08-08 16:05:19', null, '1', null, '2016-08-11 17:13:14', '78', '0', '0', '0', '0', '1', '2016-08-08 16:05:22', '1', '2016-08-31 16:53:27', '96', '0', '37');
