INSERT INTO `m_intimate_new` VALUES ('34', '测试内容长度', '1', '1', '/geekdol/hmedia/upload/image/20160816/9155b6f6-c6aa-4770-8c89-5898c6b03002.jpg,', '0', '2016-08-16 14:50:37', '<p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; font-size: 14px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">楚天都市报讯 今年25岁的胡轶华，是武汉市东西湖区的一名村官。此次《湖北手机报》上线，胡轶华成为《湖北手机报》首批免费受赠对象。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; font-size: 14px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　她说，在基层忙碌，难免有时候信息了解滞后。“有了《湖北手机报》，了解时政新闻将会更加便捷。”胡轶华高兴地说，与网络上其他信息相比，《湖北手机报》关注身边发生的大事小事，贴近性更强。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; font-size: 14px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　平时工作中，胡轶华经常和农户打交道。她发现，农户们最关注的是农产品价格。胡轶华说，有了手机报，就可以随时了解到农产品价格变动情况，及时将信息传递给农户，这样农户在种植农作物或养殖的时候就有的放矢，更有针对性。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; font-size: 14px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　眼下全省多地出现干旱。胡轶华每天都会通过手机浏览天气变化情况。《湖北手机报》贴近性很强，既有政府部门抗旱措施介绍，又有应对高温天气的人性化提醒，感觉资讯服务很及时。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; font-size: 14px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　胡轶华还希望，《湖北手机报》上可多提供一些个性化的服务。比如增加一些互动内容，及时发布一些免费讲座、大型展览等公益性活动信息。本报记者王荣海</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; font-size: 14px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">楚天都市报讯 今年25岁的胡轶华，是武汉市东西湖区的一名村官。此次《湖北手机报》上线，胡轶华成为《湖北手机报》首批免费受赠对象。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; font-size: 14px; line-height: 23px; color: 