INSERT INTO `m_intimate_new` VALUES ('83', '贴心报视频新增', '贴心报视频新增', '贴心报视频新增', '/geekdol/hmedia/upload/image/20160824/45c5ad9a-d979-472d-bfa5-98c3d6a59a07.png', '0', '2016-08-24 11:29:31', '<p>报道称，中国游客在圣彼得堡大肆采购伏特加、巧克力、套娃和琥珀。中国人对琥珀赞叹不已，认为它沉淀了历史。不少中国游客都愿意排几个小时的队，只\r\n为进入皇村的琥珀宫一睹风采。有些中国导游“言之凿凿”地说，俄罗斯历史上的很多战争起因都是琥珀！比如，彼得一世发动北方战争，就是为了夺取波罗的海的\r\n琥珀储备；琥珀也是二战爆发的原因；中国游客代表曾经向普京请求不要实施琥珀限购，然后总统同意了！（编译/朱丽峰）<img alt=\"1472009435801056424.png\" src=\"/geekdol/hmedia/upload/image/20160824/1472009435801056424.png\" title=\"1472009435801056424.png\" height=\"50\" width=\"50\"/></p><p><video class=\"edui-upload-video  vjs-default-skin video-js\" controls=\"\" preload=\"none\" width=\"420\" height=\"280\" src=\"/geekdol/hmedia/upload/video/20160824/1472009483391001106.mp4\" data-setup=\"{}\"></video></p>', '1', '1', '2016-08-24 11:29:38', '2016-08-24 11:29:42', '0', null, null, null, '0', null, null, '0', '0', '0', '0', '0', '0', '0', '1', '2016-08-24 11:31:32', '1', '2016-08-24 11:31:32', '0', '0');
