INSERT INTO `m_intimate_new` VALUES ('96', '测试', '8月22日到24日，证监会新闻宣传工作座谈会暨业务培训会在成都召开。证监会副主席姜洋出席并讲话。', '大河网', '/geekdol/hmedia/upload/image/20160825/0df9ddd7-ab64-47f4-b947-814b5d18554b.png', '0', '2016-08-25 09:39:49', '<p>8月22日到24日，证监会新闻宣传工作座谈会暨业务培训会在成都召开。证监会副主席姜洋出席并讲话。</p><p>　　姜洋指出，近年来证券期货监管系统新闻宣传和舆论引导工作取得了成绩。意识形态责任意识明显增强，预期管理水平不断提高，信息工作取得了明显成效，为资本市场改革发展创造了有利条件。</p><p>　\r\n　姜洋强调，证监会系统各单位各部门要认真学习和贯彻落实习近平总书记关于新闻舆论工作的重要讲话精神，按照党中央国务院的要求和会党委的部署，进一步增\r\n强“政治意识、大局意识、核心意识、看齐意识”，真正把意识形态工作纳入各级党委的重要工作议程并实行问责制度，切实加强与改进全系统新闻宣传和舆论引导\r\n工作，更好地服务于资本市场改革发展和监管工作。</p><p>　　会议期间，中央网信办等部门的负责同志应邀为与会同志作了工作与政策专题讲座。新闻媒\r\n体和高校的专家学者，围绕新闻发布和舆论引导、突发舆情应对处置、新媒体应用和网络舆情管理，全媒体时代舆情传播及引导等主题，与大家进行了交流。中纪委\r\n驻会纪检组的同志还就党性廉政教育进行了专题授课。</p><p>　　证监会机关各部门、各派出机构以及系统各单位的有关负责同志参加了会议。</p><p>8月25日，郑州主城区正式受理申请不动产登记业务，标志着郑州市不动产统一登记工作正式开展。</p><p>探访</p><p>“业务指南”有30项业务</p><p>按照统一部署，8月25日起，郑州市不动产登记中心及各个分中心开始受理不动产登记业务。昨日，河南商报记者来到郑州市不动产统一登记中心，进行摸底打探。</p><p>“对公业务在郑州市不动产登记中心办，个人业务得去各个分中心办理。”一名工作人员说。</p><p>记者来到二楼办事大厅，工作人员在分发刚印制好的郑州不动产登记“业务指南”。记者打开一看，其中具体业务共有30项。</p><p>郑州市不动产登记中心相关负责人说，不动产登记对保护不动产权利人的合法财产权具有重要意义。“我们会做好这项工作，保证市民顺利办理登记。”</p><p><strong>　　【提醒1】 </strong></p><p><strong>　　过完户的房子咋登记？ </strong></p><p>郑州市不动产登记中心相关负责人说，个人办理不动产登记，需要提供交易双方身份证、不动产权属证明、申请业务的原因证明材料等。具体包括：不动产登\r\n记申请书（原件）；申请人身份证明材料（原件）；不动产权属证书（原件）。房屋买卖，提交买卖合同（原件）；赠与的，提交赠与合同（原件）；因继承、受遗\r\n赠而取得的，提交相关证明材料（原件）。此外，还有其他情形申请登记的，按相关要求提供相应的材料。</p><p>不过，此类不动产登记需要当事人双方共同申请，如果是属于继承或受遗赠的，抑或生效法律文书造成权属转移情形的，可以由单方申请。</p><p><strong>　【提醒2】 </strong></p><p><strong>　　房产证丢了咋办新的？ </strong></p><p>郑州市不动产登记中心相关负责人表示，此类情况，按照“老证老办法”的原则，比如房产证丢失的，需要在媒体上刊登公告，7个工作日之后到各区分中心申请办理不动产权证，如果有土地证，则需要上交。</p><p>涉及房产抵押的，需要银行出具相关函件；如果申请人以前没有办理土地证，只要房屋坐落的土地没有问题，不违反规划或相关法律法规的，仍可正常办理不动产证。</p><p><strong>【提醒3】 </strong></p><p><strong>　　办理不动产登记咋收费？ </strong></p><p>郑州市不动产登记中心相关负责人回复称，国家层面的不动产登记收费标准即将出台，郑州市不动产登记中心（包括各分中心）从“便民、利民”的角度出发，届时将严格按国家收费标准执行，不会多收取任何额外费用。</p><p>此外根据财政部、国家发改委联合下发的《关于不动产登记收费有关政策问题的通知》文件精神，有些属于免收、减收费用的情况，详情可以到财政部官方网站查阅。</p><p><br/></p>', '1', '1', '2016-08-25 09:39:57', '2016-08-25 09:39:59', '0', null, null, null, '0', null, null, '0', '0', '0', '0', '0', '0', '0', '1', '2016-08-25 09:40:00', '1', '2016-08-25 09:40:00', '0', '0');
