al。<br/>通常原因是输出字符str中包含换行符导致的。<br/>解决方法如下：<br/>asp:<br/>str=replace(str,vbcrlf,&quot;&quot;,1,-1,1)<br/>php:<br/>$str = str_replace(&quot;\r\n&quot;, &quot;&quot;, $str);<br/>$str = str_replace(&quot;\r\n&quot;, &quot;&quot;, $str);<br/>然后再进行document.write(str)输出。&nbsp;</p><p style=\"margin-top:0px; margin-bottom:0px; padding-top:0px; padding-bottom:0px; color:rgb(69,69,69); font-family:tahoma,helvetica,arial; font-size:14px; line-height:21px\">转自网络</p><p><br/></p>', '1', '1', '2016-08-25 10:14:50', '2016-08-25 10:14:52', '0', null, null, null, '0', null, null, '0', '0', '0', '0', '0', '0', '0', '1', '2016-08-25 10:15:17', '1', '2016-08-25 10:15:52', '1', '0');
INSERT INTO `m_intimate_new` VALUES ('98', 'sjdhkjsadlka', 'sjdhkjsadlka', 'sjdhkjsadlka', '/geekdol/hmedia/upload/image/20160825/78cdd09b-5018-4446-a1d7-b87e4cd29126.png', '0', '2016-08-25 10:31:51', '<p>　中新网南阳8月23日电 (刘鹏)巴铁舆论风波仍在持续发酵。战略合约签署近百日后，三、四线华中城市河南南阳近日正遭公众质疑。匆忙签约缘何初衷？停滞搁浅有何隐情？百亿资金从何而来？容纳千人的“空中巴士”当地会乘坐几成？</p><p>　　本月2日，号称我国自行设计研制的首辆“空中巴士”巴铁1号，试车亮相秦皇岛北戴河区，一时间成为媒体追捧的焦点。然短短数日后，有关巴铁的实用性、安全性、科技含量等问题，引发质疑四起。</p><p>　　有媒体调查披露，巴铁和其背后的投资方“华赢凯来”公司，利用这个尚处测试阶段的试验品布局多地，打着地方政府拟建巴铁“PPP”项目的名义，面向公众集资。舆论甚至质疑巴铁是否终究一场“圈钱游戏”！</p><p>这是继河南省周口市、天津市河北区、河北省秦皇岛等城市后，巴铁科技签署的又一个合作城市，而且双方约定将以“PPP”模式进行合作。</p><p style=\"font-size: 14px;\">　　然而，记者近期调查走访获知，时至今日“巴铁南阳”并无丝毫进展。这一现象背后有何侧隐？当地各方又将如何看待？</p><p style=\"font-size: 14px;\">　　谈及签约巴铁，南阳市交通局城市公共交通管理科科长杨兆东言语中略感迷惘，“说实话，从目前来讲我感觉(巴铁)技术并不成熟，对于一个不成熟的东西，我们只能继续观察、观望。”“这么大的投资，(停滞)这么长时间了也不清楚会往哪走，该怎么走。”</p><p style=\"font-size: 14px;\">　　“当时(签约前)，他们(巴铁公司)说马上就要在秦皇岛做样车试验，并组织了很多\r\n人员正在公关，说进度会很快。后来，我们也去了他们的研发基地，参观了几个实验室。按照正常理解，进入试车阶段，也就意味着马上就要成形，谁知现在拿出的\r\n是这样一个正在研发阶段的产品。可以想象，这离投入运营的距离是不是很大？”</p><p style=\"font-size: 14px;\">　　说起公众质疑当地是否过早签约介入，杨兆东说，“或许是我们理解有错误，也可能是他们(巴铁公司)表述不完整。”</p><p style=\"font-size: 14px;\">　　那么计划中的百亿投资将从何而来呢？杨兆东告诉记者，虽然签约双方没有明确提出，但南阳领导已在多个场合表示不能在当地募集资金。“我们主要是想用既有的一些东西提供平台，以服务为主，但具体还要以最终签订合同为准。”</p><p style=\"font-size: 14px;\">　　尽管从当前分析来看，巴铁之路或将在未来的一段时间内困难重重，但在杨兆东看来，如果仅仅是中看不中用的项目，南阳官方是不会考虑的。杨兆东认为，一个城市有它发展的特点和规律，不能说在一线大城市没有发生的事情，在其他地方就一定不能发生。</p><p style=\"font-size: 14px;\">　　<strong>质疑四起</strong></p><p style=\"font-size: 14px;\">　　同样针对此次签约，南阳市交通局另一位不愿具名的官员则表达了不同的看法。“不可\r\n行！给我的第一印象就是不可行！”该官员举例分析，首先，乘坐率就是一个明显弊端。“一辆巴铁能乘1000多人，在南阳怎么可能聚集到这么多人？南阳的公\r\n交车一趟拉一个人的现象都存在，1000多人，怎么聚？载三五个乘客跑一趟有意义吗？”</p><p style=\"font-size: 14px;\">　　“其次，巴铁具体到现实中如何转弯、一些桥梁是否要升高、路面是否要下沉、驾驶员\r\n在巴铁下方移动的空间内行驶会不会产生心理障碍等等，可以说在项目没有成熟之前是不应该(签约)的。”该官员认为，南阳市目前并不算太堵，解决拥堵问题倒\r\n不如修几部高架桥来的实际。他坦言，“目前大家的质疑声太大了！其实，我认为即使巴铁测试过关、技术成熟，也不应该在南阳这个三四线城市推行，真要解决拥\r\n堵应该优先考虑一些大的城市。”</p><p style=\"font-size: 14px;\">　　公开资料显示，地处华中地区的河南省南阳市，截至2015年建成区人口不足200万。几日前，记者实地探访南阳市人流较为密集的人民路、仲景路、独山大道等路段发现，即使在下午5时至7时的下班<a href=\"http://celebrity.huanqiu.com/gao_feng2\" class=\"linkAbout\" target=\"_blank\" title=\"高峰\">高峰</a>期，沿路公交站牌下多数或空无一人、或三三两两。在此间来回穿梭的公交车上，乘客也稀稀落落、屈指可数。反观一些大城市的公交车时常挤满爆棚、甚至无站立之地的情景，可谓相形见绌。</p><p style=\"font-size: 14px;\">　　当地一辆29路女公交司机向记者介绍，除高峰期外，她的车平常一趟下来也就乘坐三\r\n四十人。即使像当地的1路、3路、4路这些好线路，一辆车一整天下来总共也就七八百人乘坐。说起巴铁或将在南阳落地的消息，该名女司机认为，仅以入座率来\r\n讲，南阳并没有巴铁这么庞大的乘车需求。</p><p style=\"font-size: 14px;\">　　记者试图采访带队赴京签约的南阳副市长郑茂杰、市交通局长王志凯，但两位官员在电话中均以会议为由未接受记者的采访。随后记者以短信方式再次约访，但截至发稿前，二人也均未做出回应。</p><p style=\"font-size: 14px;\">　　不过，南阳当地有人士向记者透露，他的一位市委官员朋友曾在私下场合谈起巴铁时称，巴铁或为一项融资项目，根据当前南阳的财政实力，与该项目的巨额投资根本不相匹配。该官员还认为，巴铁南阳项目或将流产。</p><p style=\"font-size: 14px;\">　　<strong>未来“谜局”</strong></p><p style=\"font-size: 14px;\">　　如此吸引地方政府迫不及待签约的巴铁，到底为何方神器？从计算机模拟效果可见，其\r\n犹如一辆装上了“高跷”的超大型巴士。上部载客区串联了四节“巴铁1号”(每节载客300人)，共可承载1200人。下层镂空，快巴在行驶时如同公路上移\r\n动的隧道，小汽车可在其“肚子”里自由穿行。</p><p style=\"font-size: 14px;\">　　有财经媒体近日报道称，其实，本月2日在秦皇岛的巴铁测试中，多名现场调试人员披\r\n露，当天巴铁并没有跑完300米的测试路段，而是仅仅行驶到较近的站台后便停下、返回，行驶距离不足百米。更有质疑声称，这是一项未经严格科学论证和试验\r\n运行的创意，却被作为“成果”匆忙公之于众，暴露出了其背后推手的急功与近利。</p><p style=\"font-size: 14px;\">　　或许，正如巴铁工业设计委托方技术顾问、同济大学材料与工程学院何大海博士此前受访时坦陈，巴铁的各项试验和测试都是一个非常复杂的过程。他表示，但巴铁的研发和制造都会遵循严格的流程和标准，“也希望多给我们一些时间和耐心！”</p><p style=\"font-size: 14px;\">　　据报道，随着舆论质疑持续发酵，“巴铁1号”试验车目前已被黑布遮体，难见真容。但依然会有不少当地市民及游客慕名前往，远远观望。</p><p>　　轰动一时的“治堵神器”巴铁未来会怎样？操盘力扶的地方政府将欲何为？是民生项目亦是形象工程？种种疑惑之际，相信公众正拭目以待。(完)\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p><br/></p>', '1', '1', '2016-08-25 10:32:55', '2016-08-25 10:32:58', '0', null, null, null, '0', null, null, '0', '0', '0', '0', '0', '0', '0', '1', '2016-08-25 10:33:00', '1', '2016-08-25 10:33:00', '0', '0');
