INSERT INTO `m_intimate_new` VALUES ('119', '你好测试', '你好测试', '你好测试', '/geekdol/hmedia/upload/image/20160826/49b607ea-c657-4fd8-8ed6-8be8ad48ab14.jpg', '0', '2016-08-26 11:44:12', '<p>应国家主席<a href=\"http://renwuku.news.ifeng.com/index/detail/5/xijinping\" target=\"_blank\">习近平</a>邀请，哈萨克斯坦共和国总统努尔苏丹·阿比舍维奇·纳扎尔巴耶夫将于9月1日至5日对中国进行工作访问，并以嘉宾国元首身份出席二十国集团领导人第十一次峰会。</p><p>问：菲律宾总统杜特尔特称，中方必须尊重南海仲裁案结果。这是否将影响中菲两国年内开展对话？另据报道，菲外长就毒品犯罪问题召见了中国驻菲大使。你对此有何回应？</p><p>答：\r\n关于第一个问题，我们已多次重申，中方对所谓南海仲裁案的立场是一贯的、明确的。菲律宾方面包括菲最高领导人近来多次表示，希望尽快同中方开启对话。昨天\r\n我已经说过，我们也愿意尽快开启中菲对话。菲律宾是我们的友好近邻，双方虽存在一些问题，但没有迈不过去的坎，双方能通过友好协商解决分歧，我们对此有信\r\n心。我们对中菲双方尽快开启会谈持积极和欢迎态度。</p><p>关于第二个问题，毒品是全人类的公敌。打击毒品犯罪是世界各国的共同责任。中国政府一贯\r\n坚定打击毒品犯罪，意志坚定，政策明确，成效显著，是国际社会打击毒品犯罪的中坚力量。中国政府长期以来也积极开展国际禁毒合作。中方理解和支持菲新政府\r\n在杜特尔特总统领导下优先打击毒品犯罪的政策，愿同菲方积极开展禁毒合作，并为此制定共同行动计划。</p><p>问：新加坡前总统纳丹日前去世，明天将举行国葬。中方是否会派代表出席？</p><p>答：纳丹先生在任新加坡总统期间，为中新关系发展作出了贡献。我们对纳丹先生逝世表示深切哀悼，向新加坡政府和人民以及纳丹先生的家属表示诚挚慰问。据我所知，新加坡驻华使馆今天下午将举行开放吊唁活动，外交部领导将前往吊唁纳丹先生。</p><p>问：请问中方对刚刚结束的中日韩外长会总体如何评价？朝鲜试射潜射导弹对会议有何影响？</p><p>答：此次会议和会见活动的情况，中方已及时发布消息。同时我注意到日本仍有一些媒体的报道与事实不符。</p><p>此\r\n次中日韩外长会是在三国彼此间关系存在一些困难的情况下召开的。中方决定出席会议，并与日韩双方有一些积极互动，本身就对于促进地区和平发展以及改善彼此\r\n关系具有建设性意义。尤其是外长会正值二十国集团杭州峰会举办前夕，日韩两国都明确表示支持中方成功举办杭州峰会，愿就此与中方加强合作。日韩也都希望在\r\n中方主持下，峰会能为世界经济注入强劲动力，并为改善双边关系提供积极因素。中方强调三方应本着“正视历史，面向未来”的精神，克服困难，排除干扰，积累\r\n共识，聚焦合作，特别是在政治、经贸、人文、可持续发展四个重点领域，通过“四轮驱动”，助力三方合作。中日韩都是东亚重要经济体，此次外长会也为即将举\r\n行的东亚合作领导人系列会议做了铺垫。会议期间，三方分别进行了双边接触，有助于有效管控分歧，改善彼此关系。三方还同意利用相继举办冬季和夏季奥运会之\r\n机，开展奥运合作，增进人民友好。</p><p>鉴于朝鲜半岛局势的最新变化，三方也就此进行了讨论。王毅外长表明了中方原则立场，强调了全面遵守落实联合国安理会第2270号决议的重要性。</p><p>问：请问在此次中日韩外长会上，海上问题是否成为突出议题？</p><p>答：\r\n此次中日韩外长会上，各方没有讨论海上问题。中日外长双边会见时，双方就东海问题深入交换了意见。王毅外长表明了中方的原则立场，主张双方都应着眼于坚持\r\n四点原则共识，妥善管控好分歧，充分发挥现有对话磋商机制的协调作用。讨论是建设性的，也是有益的。至于南海问题，不是也没有成为此次会见的议题。</p><p>问：近日俄罗斯一些旅行社和航空公司称，从8月15日到10月1日这段时间，中国调整了对俄公民的签证政策。有评论称，此举与G20峰会的安保措施有关。你能否证实？</p><p>答：\r\n我想强调，第一，原则上中国一直主张并积极采取便利措施，扩大中国同俄罗斯及其他国家人民之间的往来。在中俄两国领导人达成各项重要共识的倡导下，中方主\r\n张提供更多便利措施，增进人民间友好往来，这也有助于进一步推动两国关系向前发展。第二，俄罗斯作为大国，也曾主办过很多重要的国际活动和会议。任何一个\r\n国家，在主办G20峰会这样重大的活动时，都会采取一些临时性措施，这属于常态。第三，至于中方是否临时性对部分国家和地区的公民采取了特别签证措施，我\r\n不掌握有关情况。</p><p>问：意大利昨天发生的地震已造成数百人伤亡。中国领导人是否向意方表达慰问？有无中国公民在地震中伤亡？</p><p>答：中意是友好国家。中方高度关注意地震灾情，相信意大利政府和人民有能力战胜灾害，早日重建家园。中国领导人已向意大利领导人致慰问电。中方愿向意方提供力所能及的支持与帮助。</p><p>中国驻意大利使领馆已立即启动应急机制，通过意方、在意侨团等途径核实中国公民伤亡信息，并及时发布安全提醒。截至目前，尚未接到中国公民伤亡报告。</p><p>问：王毅外长24日会见韩国外长后表示，希望通过协商找到双方都能接受的解决办法。有关协商是否已经开始？如果尚未开始，将其他国家排除在外的中韩双边协商有何意义？</p><p>答：\r\n我的理解你指的是“萨德”问题。王毅外长昨天在东京会见韩国外长尹炳世时，确实就“萨德”问题表明了中方有关原则立场，相信你已经看到了中方发布的消息。\r\n自从韩国政府决定同意美国在韩部署“萨德”系统以来，中方在外交层面一直向韩方表明我们的立场。我们希望韩方能改变这一决定，所以我们同韩方谈这个问题不\r\n是从现在开始的。</p><p>问：我们注意到中方发布了出席G20峰会的外国领导人名单，所有相关国家都提到了领导人的姓名，只有提到巴西时使用了“巴\r\n西领导人”的说法，这是否因为巴方尚未确定哪位领导人将出席？俄罗斯近日发布参会消息时称，俄、法、德将在G20峰会期间就乌克兰问题举行三方磋商。你能\r\n否确认？</p><p>答：你注意到了这个细节，相信你可能也很清楚为什么这样宣布。目前巴西参议院仍在审议总统弹劾案。巴方表示，巴领导人愿在弹劾案结\r\n束后来华出席二十国集团杭州峰会。巴西是二十国集团重要成员，在国际和地区事务中发挥着重要作用。我们欢迎巴西领导人出席杭州峰会，愿同包括巴西在内的各\r\n方共同努力，推动峰会取得积极成果，为促进世界经济增长作出更大贡献。</p><p>关于第二个问题，我们注意到有关方面的表态。中方支持有关各方一切有利于落实明斯克协议、推动乌克兰危机政治解决进程的努力。至于能否在G20杭州峰会期间举行上述三方磋商，主要取决于有关国家。</p><p>问：台湾地区领导人将于下月访问梵蒂冈，中方是否会向梵蒂冈或意大利方面表示抗议或不满？特朗普再次威胁称，如他当选总统将向中国发起更多贸易和关税诉讼。你对此有何评论？</p><p>答：关于第一个问题，一个中国原则是国际社会的普遍共识，也是我们处理台湾对外交往问题的一贯原则。我们希望有关国家慎重处理涉台问题。</p><p>关\r\n于第二个问题，中方一贯认为，中美间保持积极、稳定、健康的双边关系，特别是在经贸领域保持互利互惠的合作关系，给中美双方民众都带来了巨大利益。我们相\r\n信，不论谁在美国大选中最终获胜，未来的美国领导人都会根据美国和美国人民的利益，继续在对华关系上选择互利合作的基本政策。</p><p>问：缅甸中部曼德勒市24日发生6.8级地震。中方是否已向缅甸抗震救灾提供帮助？目前是否有中国公民伤亡？</p><p>答：缅甸是中国的友好近邻，中方对缅甸地震造成人员伤亡和财产损失表示同情和慰问，愿根据灾情发展和缅方需求提供必要协助。</p><p>地震发生后，中国驻缅甸使领馆迅速启动领保应急机制，第一时间向缅甸政府及在缅中资公司、华侨华人核实了解中国公民伤亡信息，并提醒在缅中国公民做好相关安全防范工作。截至目前，尚未收到中国公民伤亡报告。</p><p>问：今年3月以来，苏丹政府和有关反对派先后签署非盟提出的旨在实现国内和平稳定的“路线图”协议。中方对当前苏丹国内和平进程有何评论？</p><p>答：中方支持苏丹维护国家主权、独立与领土完整，赞赏苏丹政府为落实“路线图”协议所作不懈努力。支持苏丹全国对话进程，呼吁有关方面切实执行“路线图”协议，尽快加入全国对话进程，早日实现苏丹的全面、持久和平。</p><p>问：您刚才说，俄罗斯、法国和德国要自己确定要不要举行那个会议（乌克兰问题三方会议），那中国作为主席国，是否欢迎会议在华举行？</p><p>答：\r\n倡议是有关方面而非中方提出的。刚才我也说过，我们支持一切有利于落实明斯克协议、推动乌克兰危机政治解决进程的努力。如果有关方面愿意为此做出进一步的\r\n努力，中方当然愿意提供便利。同时，中方是二十国集团峰会的主席国，这个议题并不在二十国集团议程上，二十国集团主要是一个促进加强全球主要经济体宏观经\r\n济政策协调的平台，它的主题和议题是经过各方充分协商已经确定的。</p><p>问：正在北京访问的日本国家安全保障局长今天下午跟<a href=\"http://renwuku.news.ifeng.com/index/detail/34/yangjiechi\" target=\"_blank\">杨洁篪</a>国务委员举行了政治对话，请发言人介绍一下对话内容。</p><p>答：据我所知，杨洁篪国务委员同谷内局长就改善和发展中日两国关系，包括妥善处理两国间的一些问题，加强双方务实合作，确保二十国集团杭州峰会取得成功等议题坦诚交换了意见。如果有进一步的情况，我会及时向大家提供。</p><p>问：韩国总统朴槿惠在出席G20杭州峰会期间是否会同习近平主席举行双边会谈？</p><p>你好测试你好测试你好测试你好测试</p><p>问：台湾地区领导人将于下月访问梵蒂冈，中方是否会向梵蒂冈或意大利方面表示抗议或不满？特朗普再次威胁称，如他当选总统将向中国发起更多贸易和关税诉讼。你对此有何评论？</p><p>答：关于第一个问题，一个中国原则是国际社会的普遍共识，也是我们处理台湾对外交往问题的一贯原则。我们希望有关国家慎重处理涉台问题。</p><p>关\r\n于第二个问题，中方一贯认为，中美间保持积极、稳定、健康的双边关系，特别是在经贸领域保持互利互惠的合作关系，给中美双方民众都带来了巨大利益。我们相\r\n信，不论谁在美国大选中最终获胜，未来的美国领导人都会根据美国和美国人民的利益，继续在对华关系上选择互利合作的基本政策。</p><p>问：缅甸中部曼德勒市24日发生6.8级地震。中方是否已向缅甸抗震救灾提供帮助？目前是否有中国公民伤亡？</p><p>答：缅甸是中国的友好近邻，中方对缅甸地震造成人员伤亡和财产损失表示同情和慰问，愿根据灾情发展和缅方需求提供必要协助。</p><p>地震发生后，中国驻缅甸使领馆迅速启动领保应急机制，第一时间向缅甸政府及在缅中资公司、华侨华人核实了解中国公民伤亡信息，并提醒在缅中国公民做好相关安全防范工作。截至目前，尚未收到中国公民伤亡报告。</p><p>问：今年3月以来，苏丹政府和有关反对派先后签署非盟提出的旨在实现国内和平稳定的“路线图”协议。中方对当前苏丹国内和平进程有何评论？</p><p>答：中方支持苏丹维护国家主权、独立与领土完整，赞赏苏丹政府为落实“路线图”协议所作不懈努力。支持苏丹全国对话进程，呼吁有关方面切实执行“路线图”协议，尽快加入全国对话进程，早日实现苏丹的全面、持久和平。</p><p>问：您刚才说，俄罗斯、法国和德国要自己确定要不要举行那个会议（乌克兰问题三方会议），那中国作为主席国，是否欢迎会议在华举行？</p><p>答：\r\n倡议是有关方面而非中方提出的。刚才我也说过，我们支持一切有利于落实明斯克协议、推动乌克兰危机政治解决进程的努力。如果有关方面愿意为此做出进一步的\r\n努力，中方当然愿意提供便利。同时，中方是二十国集团峰会的主席国，这个议题并不在二十国集团议程上，二十国集团主要是一个促进加强全球主要经济体宏观经\r\n济政策协调的平台，它的主题和议题是经过各方充分协商已经确定的。</p><p>问：正在北京访问的日本国家安全保障局长今天下午跟<a href=\"http://renwuku.news.ifeng.com/index/detail/34/yangjiechi\" target=\"_blank\">杨洁篪</a>国务委员举行了政治对话，请发言人介绍一下对话内容。</p><p>答：据我所知，杨洁篪国务委员同谷内局长就改善和发展中日两国关系，包括妥善处理两国间的一些问题，加强双方务实合作，确保二十国集团杭州峰会取得成功等议题坦诚交换了意见。如果有进一步的情况，我会及时向大家提供。</p><p>问：韩国总统朴槿惠在出席G20杭州峰会期间是否会同习近平主席举行双边会谈？</p><p><br/></p>', '1', '1', '2016-08-26 11:44:20', '2016-08-26 11:44:22', '2', null, null, null, '0', null, null, '0', '0', '0', '0', '0', '0', '0', '1', '2016-08-26 11:44:35', '1', '2016-08-26 11:44:35', '0', '0');
INSERT INTO `m_intimate_new` VALUES ('120', '新增测试', '新增测试新增测试', '新增测试', '/geekdol/hmedia/upload/image/20160826/00113042-41cd-457a-83fa-6796f06548f3.jpg', '0', '2016-08-26 11:48:24', '<p>新增测试新增测试新增测试新增测试新增测试新增测试</p>', '1', '1', '2016-08-26 11:48:30', '2016-08-26 11:48:32', '2', '可以通过', '1', '2016-08-26 11:49:00', '1', '2016-08-26 11:49:00', '1', '1', '0', '2', '0', '0', '0', '0', '1', '2016-08-26 11:48:35', '30', '2016-08-29 15:14:11', '5', '0');
INSERT INTO `m_intimate_new` VALUES ('121', '是多少收到收到', '的收到都是是', '收到是多少', '/geekdol/hmedia/upload/image/20160826/c7e1c889-7bc9-4de5-916a-d0ea57f058ce.jpg', '0', '2016-08-26 13:20:25', '<p>颠三倒四都是</p><p style=\"TEXT-INDENT: 2em\">国产航母“既有外在颜值，更有内在气质”。在昨天的国防部例行记者会上，针对中国第一艘国产航母的建造情况，国防部新闻局副局长、国防部新闻发言人吴谦上校做出如上表述。另外，针对“陆军现有18个集团军将缩编成师”的传闻，吴谦表示，有关报道纯属臆测，与事实不符。</p><p style=\"TEXT-INDENT: 2em\"><strong>国产航母建造顺利</strong></p><p style=\"TEXT-INDENT: 2em\">有记者问，最近国内外媒体大篇幅报道了中国第一艘国产航母的建造情况，网上还流传着这艘航母“高颜值”的照片，显示船体装配已经接近完成，建造工作接近尾声。请问以上情况是否属实？这艘航母离列装还有多长时间？有没有时间表？</p><p style=\"TEXT-INDENT: 2em\">吴谦就此表示，“可以授权告诉你的是，首艘国产航母的建造进展顺利，正在按计划推进。”吴谦表示，关于记者提到的“高颜值”，只说对了一半，我们这艘国产航母“既有外在颜值，更有内在气质”。</p><p style=\"TEXT-INDENT: 2em\"><strong>回应部分文艺兵下岗</strong></p><p style=\"TEXT-INDENT: 2em\">有记者问，听说由于军队改革已经有一部分文艺兵或者军队歌舞团成员开始下岗，但又有一些国内报道称，这只是军队文艺团体改变名称、编制或组织形式。请问这到底是怎么回事？有多少人下岗或者被裁掉？</p><p style=\"TEXT-INDENT: 2em\">吴谦介绍说，这轮军队改革坚持自上而下、分步实施、统筹推进各阶段改革任务，到2020年基本完成国防和军队改革的目标任务。关于军队文艺团体的改革，将适时发布信息。</p><p style=\"TEXT-INDENT: 2em\"><strong>“萨德”打破战略平衡</strong></p><p style=\"TEXT-INDENT: 2em\">据报道，美国陆军参谋长米莱访华时向中方表示，“萨德”系统的部署完全是为了保护韩国和美国人免受朝鲜导弹袭击，其雷达探测距离仅几百公里，不会覆盖中国内陆，在任何方面都不会对中国造成威胁。</p><p style=\"TEXT-INDENT: 2em\">吴谦就此表示，美在韩部署“萨德”反导系统，不仅是一个战役战术问题，更是一个战略问题。这种做法打破了地区的战略平衡，损害了中国的战略利益，破坏了中美、中韩之间的战略互信。打个比喻说，部署“萨德”系统就像在本地区打开了一个“潘多拉盒子”，其引发的恶果不容小觑。</p><p style=\"TEXT-INDENT: 2em\">吴谦说，虽然美官方多次表示“萨德”反导系统的雷达探测距离只有几百公里，但据韩国媒体报道，美国国防部导弹防御局局长叙林最近在访韩时表示，“萨德”反导系统可以在短时间内由“末端模式”转为“前沿模式”，而“前沿模式”下，雷达探测距离为1000公里以上。</p><p style=\"TEXT-INDENT: 2em\">“他的表态听起来很有故事。” 吴谦说。</p><p style=\"TEXT-INDENT: 2em\"><strong>“朝鲜士兵越境”属捏造</strong></p><p style=\"TEXT-INDENT: 2em\">有记者问，有韩国媒体称，2名朝鲜士兵本月17日携带武器越境进入中国境内，被中国边防部队发现之后双方发生交火，并有中国军人受伤。请予以证实。</p><p style=\"TEXT-INDENT: 2em\">吴谦回应说，据了解，韩媒的这个报道无中生有，纯属捏造。</p><p style=\"TEXT-INDENT: 2em\"><strong>防空识别区不是领空</strong></p><p style=\"TEXT-INDENT: 2em\">韩国媒体报道，中国近日在东海举行联合演习时，中方战机短暂飞越了中韩防空识别区重叠区域，并靠近苏岩礁，韩国方面起飞军机进行了拦截。韩国内一些媒体把这个事件和“萨德”部署问题联系起来，认为是中国在施压。</p><p style=\"TEXT-INDENT: 2em\">吴谦表示，防空识别区不是领空。近日中国军机赴日本海有关空域进行训练，其间经过了东海防空识别区以及其他相关的国际空域，这是一次计划内的演训活动。</p><p style=\"TEXT-INDENT: 2em\"><strong>回应印度部署导弹</strong></p><p style=\"TEXT-INDENT: 2em\">针对印度政府近期决定在中印边境地区部署“布拉莫斯”导弹一事，吴谦指出，保持中印边境地区的和平与安宁，是中印双方达成的重要共识。中方希望印方多做有利于中印边境地区和平稳定的事情，而不是相反。</p><p style=\"TEXT-INDENT: 2em\">北京晨报记者 韩娜</p><p style=\"TEXT-INDENT: 2em\">国产航母“既有外在颜值，更有内在气质”。在昨天的国防部例行记者会上，针对中国第一艘国产航母的建造情况，国防部新闻局副局长、国防部新闻发言人吴谦上校做出如上表述。另外，针对“陆军现有18个集团军将缩编成师”的传闻，吴谦表示，有关报道纯属臆测，与事实不符。</p><p style=\"TEXT-INDENT: 2em\"><strong>国产航母建造顺利</strong></p><p style=\"TEXT-INDENT: 2em\">有记者问，最近国内外媒体大篇幅报道了中国第一艘国产航母的建造情况，网上还流传着这艘航母“高颜值”的照片，显示船体装配已经接近完成，建造工作接近尾声。请问以上情况是否属实？这艘航母离列装还有多长时间？有没有时间表？</p><p style=\"TEXT-INDENT: 2em\">吴谦就此表示，“可以授权告诉你的是，首艘国产航母的建造进展顺利，正在按计划推进。”吴谦表示，关于记者提到的“高颜值”，只说对了一半，我们这艘国产航母“既有外在颜值，更有内在气质”。</p><p style=\"TEXT-INDENT: 2em\"><strong>回应部分文艺兵下岗</strong></p><p style=\"TEXT-INDENT: 2em\">有记者问，听说由于军队改革已经有一部分文艺兵或者军队歌舞团成员开始下岗，但又有一些国内报道称，这只是军队文艺团体改变名称、编制或组织形式。请问这到底是怎么回事？有多少人下岗或者被裁掉？</p><p style=\"TEXT-INDENT: 2em\">吴谦介绍说，这轮军队改革坚持自上而下、分步实施、统筹推进各阶段改革任务，到2020年基本完成国防和军队改革的目标任务。关于军队文艺团体的改革，将适时发布信息。</p><p style=\"TEXT-INDENT: 2em\"><strong>“萨德”打破战略平衡</strong></p><p style=\"TEXT-INDENT: 2em\">据报道，美国陆军参谋长米莱访华时向中方表示，“萨德”系统的部署完全是为了保护韩国和美国人免受朝鲜导弹袭击，其雷达探测距离仅几百公里，不会覆盖中国内陆，在任何方面都不会对中国造成威胁。</p><p style=\"TEXT-INDENT: 2em\">吴谦就此表示，美在韩部署“萨德”反导系统，不仅是一个战役战术问题，更是一个战略问题。这种做法打破了地区的战略平衡，损害了中国的战略利益，破坏了中美、中韩之间的战略互信。打个比喻说，部署“萨德”系统就像在本地区打开了一个“潘多拉盒子”，其引发的恶果不容小觑。</p><p style=\"TEXT-INDENT: 2em\">吴谦说，虽然美官方多次表示“萨德”反导系统的雷达探测距离只有几百公里，但据韩国媒体报道，美国国防部导弹防御局局长叙林最近在访韩时表示，“萨德”反导系统可以在短时间内由“末端模式”转为“前沿模式”，而“前沿模式”下，雷达探测距离为1000公里以上。</p><p style=\"TEXT-INDENT: 2em\">“他的表态听起来很有故事。” 吴谦说。</p><p style=\"TEXT-INDENT: 2em\"><strong>“朝鲜士兵越境”属捏造</strong></p><p style=\"TEXT-INDENT: 2em\">有记者问，有韩国媒体称，2名朝鲜士兵本月17日携带武器越境进入中国境内，被中国边防部队发现之后双方发生交火，并有中国军人受伤。请予以证实。</p><p style=\"TEXT-INDENT: 2em\">吴谦回应说，据了解，韩媒的这个报道无中生有，纯属捏造。</p><p style=\"TEXT-INDENT: 2em\"><strong>防空识别区不是领空</strong></p><p style=\"TEXT-INDENT: 2em\">韩国媒体报道，中国近日在东海举行联合演习时，中方战机短暂飞越了中韩防空识别区重叠区域，并靠近苏岩礁，韩国方面起飞军机进行了拦截。韩国内一些媒体把这个事件和“萨德”部署问题联系起来，认为是中国在施压。</p><p style=\"TEXT-INDENT: 2em\">吴谦表示，防空识别区不是领空。近日中国军机赴日本海有关空域进行训练，其间经过了东海防空识别区以及其他相关的国际空域，这是一次计划内的演训活动。</p><p style=\"TEXT-INDENT: 2em\"><strong>回应印度部署导弹</strong></p><p style=\"TEXT-INDENT: 2em\">针对印度政府近期决定在中印边境地区部署“布拉莫斯”导弹一事，吴谦指出，保持中印边境地区的和平与安宁，是中印双方达成的重要共识。中方希望印方多做有利于中印边境地区和平稳定的事情，而不是相反。</p><p style=\"TEXT-INDENT: 2em\">北京晨报记者 韩娜</p><p><video class=\"edui-upload-video video-js vjs-default-skin video-js\" controls=\"\" preload=\"none\" src=\"/geekdol/hmedia/upload/video/20160826/1472188885959011783.mp4\" data-setup=\"{}\" height=\"50\" width=\"50\"></video></p>', '0', '0', null, null, '0', null, null, null, '0', null, null, '0', '0', '0', '0', '0', '0', '0', '1', '2016-08-26 13:21:37', '1', '2016-08-26 13:21:37', '0', '0');
