INSERT INTO `m_intimate_new` VALUES ('127', '乌梅测试', '乌梅测试', '乌梅测试', '/geekdol/hmedia/upload/image/20160830/ffea0d21-4a24-40b4-9a34-ea7a57fd4b5f.jpg', '0', '2016-08-30 09:54:52', '<p>据媒体报道，过去曾多次揭露希拉里“黑历史”的作家克莱恩日前宣布，他将在10月4日推出新书Guilty as \r\nSin，扬言书中含有爆炸性的内容，揭露希拉里“电邮门”丑闻背后一些程度等同“叛国”的贪腐行为。79岁的克莱恩自2005年起先后出版三本批评希拉里\r\n的书籍，其著作经常被批内容过火，批评者中不乏共和党人。</p><p>　　克莱恩说，这本新书将集中讲述希拉里“电邮门”事件。他说，这本新作将揭露“电邮门”丑闻背后的真实故事，以及希拉里如何凌驾于法律之上的肮脏\r\n政治游戏。他指出，这本书也会披露国会进行调查时，有人犯下严重程度等同叛国的贪腐行为。“透过这本新书的内容，读者可以清楚知道希拉里和丈夫、前总统克\r\n林顿如何想方设法重返白宫，而他们的锦囊内还剩下多少伎俩。”克莱恩表示，“电邮门”丑闻爆发后，希拉里大发雷霆，怒骂奥巴马，指责其政府进行的调查。报\r\n道称，如果克莱恩所言属实，势必严重打击希拉里阵营，更可能成为今年美国大选的“十月惊奇”。</p><p><video class=\"edui-upload-video video-js vjs-default-skin video-js\" controls=\"\" preload=\"none\" src=\"/geekdol/hmedia/upload/video/20160830/1472522162754001658.mp4\" data-setup=\"{}\" height=\"280\" width=\"420\"></video></p>', '1', '1', '2016-08-30 09:54:59', '2016-08-30 09:55:01', '2', null, null, null, '1', '2016-08-30 09:58:07', '1', '0', '0', '75', '20', '0', '0', '0', '1', '2016-08-30 09:56:13', '1', '2016-08-30 09:58:07', '99', '0');
