INSERT INTO `m_intimate_new` VALUES ('260', '富文本测试', null, '富文本测试', '/geekdol/hmedia/upload/image/20160919/c2bf5040-6295-42d7-9ab1-3fe7f6e0adad.jpg', '0', '2016-09-19 18:30:44', '  <p style=\"TEXT-INDENT: 2em\">京华时报讯（记者沙雪良）《机动车驾驶培训先学后付、计时收费模式服务合同（示范文本）》昨天发布。该文本自今年10月1日起实施。今年年初，交通运输部将“50%的驾校试点将先培训后付费”列为今年将推进的民生实事之一。</p>\r\n  <p style=\"TEXT-INDENT: 2em\"><strong>每次培训后按时段付费</strong></p>\r\n  <p style=\"TEXT-INDENT: 2em\">合同示范文本第六条“费用与支付方式”中列明：学驾人一次性支付“道路交通安全法律、法规和相关知识”、“安全文明驾驶常识”理论知识培训费与教材费、建立档案材料费等；每次完成驾驶操作技能培训后，按预约时段学时价格支付培训费用。不同时段的学时单价详见本合同附件。</p>\r\n  <p style=\"TEXT-INDENT: 2em\">在 合同附件《机动车驾驶培训费用构成明细表》中，收费项目被分成5大类，分别是相关服务费用（包含教材费、人身意外伤害保险费等）、理论知识培训费、驾驶模 拟培训费、基础和场地驾驶培训、道路驾驶训练等。其中，后三项收费又细分为普通时段、高峰时段和假节日时段三类，分别标明学时单价。</p>\r\n  <p style=\"TEXT-INDENT: 2em\"><strong>教练索财物学员可拒付</strong></p>\r\n  <p style=\"TEXT-INDENT: 2em\">示范合同明确，在培训过程中，学驾人若发现培训机构提供的教练车未经检测合格、教练员和管理人员减少培训项目和学时、伪造或篡改培训数据、向学驾人索取、收受财物或牟取其他利益等问题的，有权要求培训机构予以纠正，并可拒付相应时段的培训费用。</p>\r\n  <p style=\"TEXT-INDENT: 2em\">另外，学驾人发现培训机构未在交通运输管理部门许可核定的训练场地或未在公安机关交通管理部门指定的路线、时间提供培训服务的，有权要求培训机构予以纠正，并可拒付相应时段的培训费用。</p>\r\n  <p style=\"TEXT-INDENT: 2em\"><strong>&gt;&gt;落点</strong></p>\r\n  <p style=\"TEXT-INDENT: 2em\"><strong>北京有驾校试点先考科目一再付费</strong></p>\r\n  <p style=\"TEXT-INDENT: 2em\">记者了解到，虽然北京并非先培训后付费试点地区，有几家驾校已经开始进行了类似试点。</p>\r\n  <p style=\"TEXT-INDENT: 2em\">昨 天下午，某日均培训学员上千人的驾校的负责人介绍，该校从两个月前开始推出了初级版的“先培训后付费”试点，百分之九十的学员都选择了这种方式。具体做法 是，在学员科目一考试合格前不交任何费用，学员科目一考试合格后，通过122统一报名平台成功报名后，再选择班别并缴费。</p>\r\n  <p style=\"TEXT-INDENT: 2em\">这名负责人表示，驾校下一步的设想是，学员在每堂课后给教练打分，并通过微信等交费。“这样教练员的工资就一下子分出了高中低档了”，可以推动教练更好地为学员服务。</p>\r\n', '0', '0', null, null, '0', null, null, null, '0', null, null, '0', '0', '0', '0', '0', '0', '0', '1', '2016-09-19 18:33:03', '1', '2016-09-19 18:33:03', '0', '0');
