INSERT INTO `m_intimate_new` VALUES ('284', 'sdsd', null, 'sdsd', '/geekdol/hmedia/upload/image/20160926/ba67a181-9832-4764-aacf-6de8150751c7.jpg', '0', '2016-09-26 16:14:46', '<p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">&nbsp;&nbsp;&nbsp; 郑州市不动产登记工作正全面提速，平均每天发证百余本。郑州市国土资源局有关负责人表示，力争不动产登记在申请后7个工作日内办结。如此一来，市民办房产过户的时间将大大缩短。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><strong>　　【行动】</strong></span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><strong>　　一天发证百余本</strong></span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　郑州市不动产登记备受社会关注，由于前期工作量较大等原因，市民预约申请不动产登记时，在“权籍调查”环节卡了壳，造成大范围积压，导致市民拿证(不动产权证书和不动产登记证明)时间一再推迟。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　为加速办理，为市民提供方便快捷的办理通道，郑州市国土资源局于9月22日连夜召开会议，并制定六项措施。目前，其工作时间已更改为上午8点至晚8点，双休日不休息。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　24日、25日，本来是郑州市不动产登记中心金水区分中心工作人员休息的日子，但是，连续两天，金水区行政审批服务大厅“门庭若市”，前来办理各类登记业务的市民络绎不绝。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　郑州市民闵女士在9月中旬预约了权籍调查，还没到预约的日期，工作人员就打电话通知，称周末继续上班，她可以提前来办理。闵女士喜出望外，二手房原业主急着用钱，再等不到不动产权证，监管账户不放款，闵女士就面临“被毁约”的风险。这下她高兴坏了，当天早上7点就到了。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　顺利办完后，工作人员告诉她，5个工作日内会有工作人员和闵女士确认房屋坐落等信息，然后再来申请登记，很快就能出证。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　河南商报记者从郑州市国土资源局了解到，郑州市不动产登记全面提速后，仅9月23日当天就颁发不动产权证105本。9月24日颁发不动产权证130本，办证速度明显加快。9月25日颁发108本不动产权证。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><strong>　　【措施】</strong></span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><strong>　　流程已优化 权籍调查时间压缩</strong></span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　“我9月7日就做过权籍调查了，为什么到现在还没通知我来申请登记?”24日有市民问。很多办事者都有类似疑问，有的说：“我们小区我竟然是第一个做权籍调查的，等待时间长，接下来小区业主再做权籍调查就很快了，公平吗?”</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　据河南商报记者了解，老百姓反映最为集中的问题就是权籍调查等待时间太长，短则半个月，长则一个月，甚至更长。有市民反映，他要正式申请登记，都排到11月了。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　郑州市国土资源局有关负责人说，之前权籍调查采取的工作方式是，一户申请则要调查一个小区，并进行整宗土地的分割，一步一步来。这样处理，前期的工作量会非常大，后期逐渐减小。这样做有利也有弊，弊就是，同一个小区，谁先申请权籍调查，谁等待时间就长。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　而且，在目前郑州的权籍调查工作中还出现一种现象——实地测绘完成数，大大高于“数据入库数”。前期积攒的工作量太大，也是一大重要原因。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　现在，为了压缩权籍调查时间，郑州市国土资源局尝试“一户申请调查一户，不进行整宗土地分割”，从权籍调查处理方式的转变上压缩时间。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　换句话说，就像原来的“大土地证”，先不做分割，先按整宗地生成“单元号”，快速出证，剩下的事情交给国土局做，最起码市民不用等了，这就极大压缩了等待时间。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　针对“权籍调查”，该局表示，将从技术层面进一步压缩这项工作的时间，利用“第二次全国土地调查成果数据”的同时，进行系统的优化调整，尽早具备登记条件。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　上周末两天，河南商报记者在走访过程中看到，不动产登记部门在工作过程中不断地对系统进行调试，以保证万无一失。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><strong>　　【努力】</strong></span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><strong>　　力争7个工作日出证</strong></span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　权籍调查持续时间过长，是导致不动产证出证慢的重要原因。目前，郑州市国土资源局已针对这个问题开了“药方”，不仅在流程上进行优化，还在办公人员上进行补充。据河南商报记者了解，原来每个分中心平均分配的外业测绘队，现在也通过“统筹方法”灵活指派作业，即哪个地方需要就去哪个地方，使资源得到最大限度的利用。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　据该局有关负责人表示，近3天是不动产登记提速试验的3天，力争不动产登记在申请后7个工作日内办结。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><strong>　　【消息】</strong></span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><strong>　　国庆节不放假</strong></span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><strong>　　继续办理不动产登记</strong></span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　郑州市国土资源局有关负责人告诉河南商报记者，为满足广大市民办理不动产登记需求，全市9个不动产登记中心在国庆节放假期间正常上班，全力以赴为广大市民办理各种不动产登记事项。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　由于全市不动产登记工作加速，办理登记速度明显加快，尽管不动产登记中心工作人员反复催促，但仍然不能及时领取。因此，市不动产登记中心有关负责人提醒广大市民，请按照不动产登记中心工作人员通知，及时到办证地点领取权证。</span></p><p><br/></p><p><br/></p><p><br/></p>', '0', '0', null, null, '0', null, null, null, '0', null, null, '0', '0', '0', '0', '0', '0', '0', '1', '2016-09-26 16:14:51', '1', '2016-09-26 16:15:22', '1', '0');
INSERT INTO `m_intimate_new` VALUES ('285', 'dsfdsfdsf', null, 'dsfdsfdsf', '/geekdol/hmedia/upload/image/20160928/1f400b4e-094d-4732-b74f-274821d2ac36.png,/geekdol/hmedia/upload/image/20160928/0b027b7d-4b8a-4a39-8e54-ee0fc876057e.png,/geekdol/hmedia/upload/image/20160928/1ed7c19c-bbdc-4d4b-9f1e-df63783fac5c.png', '1', '2016-09-27 16:36:27', '<p style=\"line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">郑州市不动产登记工作正全面提速，平均每天发证百余本。郑州市国土资源局有关负责人表示，力争不动产登记在申请后7个工作日内办结。如此一来，市民办房产过户的时间将大大缩短。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><strong>　　【行动】</strong></span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><strong>　　一天发证百余本</strong></span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　郑州市不动产登记备受社会关注，由于前期工作量较大等原因，市民预约申请不动产登记时，在“权籍调查”环节卡了壳，造成大范围积压，导致市民拿证(不动产权证书和不动产登记证明)时间一再推迟。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　为加速办理，为市民提供方便快捷的办理通道，郑州市国土资源局于9月22日连夜召开会议，并制定六项措施。目前，其工作时间已更改为上午8点至晚8点，双休日不休息。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　24日、25日，本来是郑州市不动产登记中心金水区分中心工作人员休息的日子，但是，连续两天，金水区行政审批服务大厅“门庭若市”，前来办理各类登记业务的市民络绎不绝。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　郑州市民闵女士在9月中旬预约了权籍调查，还没到预约的日期，工作人员就打电话通知，称周末继续上班，她可以提前来办理。闵女士喜出望外，二手房原业主急着用钱，再等不到不动产权证，监管账户不放款，闵女士就面临“被毁约”的风险。这下她高兴坏了，当天早上7点就到了。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　顺利办完后，工作人员告诉她，5个工作日内会有工作人员和闵女士确认房屋坐落等信息，然后再来申请登记，很快就能出证。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　河南商报记者从郑州市国土资源局了解到，郑州市不动产登记全面提速后，仅9月23日当天就颁发不动产权证105本。9月24日颁发不动产权证130本，办证速度明显加快。9月25日颁发108本不动产权证。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><strong>　　【措施】</strong></span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><strong>　　流程已优化 权籍调查时间压缩</strong></span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　“我9月7日就做过权籍调查了，为什么到现在还没通知我来申请登记?”24日有市民问。很多办事者都有类似疑问，有的说：“我们小区我竟然是第一个做权籍调查的，等待时间长，接下来小区业主再做权籍调查就很快了，公平吗?”</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　据河南商报记者了解，老百姓反映最为集中的问题就是权籍调查等待时间太长，短则半个月，长则一个月，甚至更长。有市民反映，他要正式申请登记，都排到11月了。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　郑州市国土资源局有关负责人说，之前权籍调查采取的工作方式是，一户申请则要调查一个小区，并进行整宗土地的分割，一步一步来。这样处理，前期的工作量会非常大，后期逐渐减小。这样做有利也有弊，弊就是，同一个小区，谁先申请权籍调查，谁等待时间就长。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　而且，在目前郑州的权籍调查工作中还出现一种现象——实地测绘完成数，大大高于“数据入库数”。前期积攒的工作量太大，也是一大重要原因。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　现在，为了压缩权籍调查时间，郑州市国土资源局尝试“一户申请调查一户，不进行整宗土地分割”，从权籍调查处理方式的转变上压缩时间。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　换句话说，就像原来的“大土地证”，先不做分割，先按整宗地生成“单元号”，快速出证，剩下的事情交给国土局做，最起码市民不用等了，这就极大压缩了等待时间。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　针对“权籍调查”，该局表示，将从技术层面进一步压缩这项工作的时间，利用“第二次全国土地调查成果数据”的同时，进行系统的优化调整，尽早具备登记条件。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　上周末两天，河南商报记者在走访过程中看到，不动产登记部门在工作过程中不断地对系统进行调试，以保证万无一失。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><strong>　　【努力】</strong></span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><strong>　　力争7个工作日出证</strong></span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　权籍调查持续时间过长，是导致不动产证出证慢的重要原因。目前，郑州市国土资源局已针对这个问题开了“药方”，不仅在流程上进行优化，还在办公人员上进行补充。据河南商报记者了解，原来每个分中心平均分配的外业测绘队，现在也通过“统筹方法”灵活指派作业，即哪个地方需要就去哪个地方，使资源得到最大限度的利用。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　据该局有关负责人表示，近3天是不动产登记提速试验的3天，力争不动产登记在申请后7个工作日内办结。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><strong>　　【消息】</strong></span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><strong>　　国庆节不放假</strong></span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><strong>　　继续办理不动产登记</strong></span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　郑州市国土资源局有关负责人告诉河南商报记者，为满足广大市民办理不动产登记需求，全市9个不动产登记中心在国庆节放假期间正常上班，全力以赴为广大市民办理各种不动产登记事项。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　由于全市不动产登记工作加速，办理登记速度明显加快，尽管不动产登记中心工作人员反复催促，但仍然不能及时领取。因此，市不动产登记中心有关负责人提醒广大市民，请按照不动产登记中心工作人员通知，及时到办证地点领取权证。</span></p><p><br/></p><p><br/></p>', '0', '0', null, null, '2', 'asdfasdfasdf', '1', '2016-09-28 17:52:27', '1', '2016-09-28 17:52:27', '1', '0', '0', '1', '0', '0', '0', '0', '1', '2016-09-26 16:36:37', '1', '2016-09-30 11:15:39', '5', '0');
INSERT INTO `m_intimate_new` VALUES ('286', 'hdsjfjdshfds', null, 'dsfdsfdsf', '/geekdol/hmedia/upload/image/20160926/8e914329-115d-4e6a-b4e1-dfd49e5f41b6.jpg', '0', '2016-09-28 16:37:34', '<p style=\"line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">郑州市不动产登记工作正全面提速，平均每天发证百余本。郑州市国土资源局有关负责人表示，力争不动产登记在申请后7个工作日内办结。如此一来，市民办房产过户的时间将大大缩短。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><strong>　　【行动】</strong></span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><strong>　　一天发证百余本</strong></span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　郑州市不动产登记备受社会关注，由于前期工作量较大等原因，市民预约申请不动产登记时，在“权籍调查”环节卡了壳，造成大范围积压，导致市民拿证(不动产权证书和不动产登记证明)时间一再推迟。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　为加速办理，为市民提供方便快捷的办理通道，郑州市国土资源局于9月22日连夜召开会议，并制定六项措施。目前，其工作时间已更改为上午8点至晚8点，双休日不休息。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　24日、25日，本来是郑州市不动产登记中心金水区分中心工作人员休息的日子，但是，连续两天，金水区行政审批服务大厅“门庭若市”，前来办理各类登记业务的市民络绎不绝。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　郑州市民闵女士在9月中旬预约了权籍调查，还没到预约的日期，工作人员就打电话通知，称周末继续上班，她可以提前来办理。闵女士喜出望外，二手房原业主急着用钱，再等不到不动产权证，监管账户不放款，闵女士就面临“被毁约”的风险。这下她高兴坏了，当天早上7点就到了。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　顺利办完后，工作人员告诉她，5个工作日内会有工作人员和闵女士确认房屋坐落等信息，然后再来申请登记，很快就能出证。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　河南商报记者从郑州市国土资源局了解到，郑州市不动产登记全面提速后，仅9月23日当天就颁发不动产权证105本。9月24日颁发不动产权证130本，办证速度明显加快。9月25日颁发108本不动产权证。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><strong>　　【措施】</strong></span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><strong>　　流程已优化 权籍调查时间压缩</strong></span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　“我9月7日就做过权籍调查了，为什么到现在还没通知我来申请登记?”24日有市民问。很多办事者都有类似疑问，有的说：“我们小区我竟然是第一个做权籍调查的，等待时间长，接下来小区业主再做权籍调查就很快了，公平吗?”</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　据河南商报记者了解，老百姓反映最为集中的问题就是权籍调查等待时间太长，短则半个月，长则一个月，甚至更长。有市民反映，他要正式申请登记，都排到11月了。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　郑州市国土资源局有关负责人说，之前权籍调查采取的工作方式是，一户申请则要调查一个小区，并进行整宗土地的分割，一步一步来。这样处理，前期的工作量会非常大，后期逐渐减小。这样做有利也有弊，弊就是，同一个小区，谁先申请权籍调查，谁等待时间就长。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　而且，在目前郑州的权籍调查工作中还出现一种现象——实地测绘完成数，大大高于“数据入库数”。前期积攒的工作量太大，也是一大重要原因。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　现在，为了压缩权籍调查时间，郑州市国土资源局尝试“一户申请调查一户，不进行整宗土地分割”，从权籍调查处理方式的转变上压缩时间。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　换句话说，就像原来的“大土地证”，先不做分割，先按整宗地生成“单元号”，快速出证，剩下的事情交给国土局做，最起码市民不用等了，这就极大压缩了等待时间。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　针对“权籍调查”，该局表示，将从技术层面进一步压缩这项工作的时间，利用“第二次全国土地调查成果数据”的同时，进行系统的优化调整，尽早具备登记条件。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　上周末两天，河南商报记者在走访过程中看到，不动产登记部门在工作过程中不断地对系统进行调试，以保证万无一失。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><strong>　　【努力】</strong></span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><strong>　　力争7个工作日出证</strong></span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　权籍调查持续时间过长，是导致不动产证出证慢的重要原因。目前，郑州市国土资源局已针对这个问题开了“药方”，不仅在流程上进行优化，还在办公人员上进行补充。据河南商报记者了解，原来每个分中心平均分配的外业测绘队，现在也通过“统筹方法”灵活指派作业，即哪个地方需要就去哪个地方，使资源得到最大限度的利用。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　据该局有关负责人表示，近3天是不动产登记提速试验的3天，力争不动产登记在申请后7个工作日内办结。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><strong>　　【消息】</strong></span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><strong>　　国庆节不放假</strong></span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><strong>　　继续办理不动产登记</strong></span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　郑州市国土资源局有关负责人告诉河南商报记者，为满足广大市民办理不动产登记需求，全市9个不动产登记中心在国庆节放假期间正常上班，全力以赴为广大市民办理各种不动产登记事项。</span></p><p style=\"margin: 0px; padding: 0px 0px 29px; font-size: 16px; color: rgb(51, 51, 51); font-family: SimSun,宋体,&quot;Arial Narrow&quot;,HELVETICA; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">　　由于全市不动产登记工作加速，办理登记速度明显加快，尽管不动产登记中心工作人员反复催促，但仍然不能及时领取。因此，市不动产登记中心有关负责人提醒广大市民，请按照不动产登记中心工作人员通知，及时到办证地点领取权证。</span></p><p><br/></p><p><br/></p>', '0', '0', null, null, '2', null, null, null, '0', null, null, '0', '0', '0', '0', '0', '1', '0', '1', '2016-09-26 16:37:52', '1', '2016-09-26 16:42:36', '1', '0');
INSERT INTO `m_intimate_new` VALUES ('287', '测试超长内动大道', null, 'autoFloatEnabled', '/geekdol/hmedia/upload/image/20160927/508e26b8-226c-4299-a708-51eceda3d464.jpg', '0', '2016-09-27 10:02:07', '<p>原标题：不能让奸商在楼市浑水摸鱼</p><p>深圳“鸽笼房”事件让公众看到，值此楼市风云变幻之际，在其中浑水摸鱼的奸商着实不少。<a href=\"http://house.ifeng.com/special/gaofangjiaganbuzouyetuzi/\" target=\"_blank\">高房价</a>不能成为作奸犯科的理由，更不能成为不法行为的掩护，监管部门必须加大力度规范楼市秩序，严惩热点事件中的相关责任人，坚决遏制炒作歪风。</p><p>“深圳6平方米鸽笼房半天售罄，均价15万每平方米”。针对此事，深圳市规划国土委26日通报了相关情况，称所涉11套6平方米的房产户型与规划验收竣工图不符，实际在售面积12平方米左右（其中一套约20平方米），超过部分占用了建筑公摊面积，涉嫌违法改建销售。深圳市有关部门已约谈当事人，对涉嫌违法违规行为责令立即整改，并按照职责分工依法做出相应处理。（相关报道见A14版）</p><p>深圳“鸽笼房”的新闻近日被炒得沸沸扬扬，之所以引人关注，首先在于“鸽笼房”的尺寸挑战了人们想象力的极限，一张双人床也有近4平方米大小，6平方米的“鸽笼房”几乎做到了极致，难怪会引人侧面。楼市出奇葩，今年特别多，上海的离婚购房潮，杭州的抢房大作战，上市公司的卖房保命等等。楼市风起云涌搞得人心浮躁，有人卖房变现千万离场，有人借高利贷当<a href=\"http://house.ifeng.com/news/touzi/detail_2010_03/31/444788_0.shtml\" target=\"_blank\">首付</a>进场，而大多数人则是左右彷徨、进退无据。就在此时，“鸽笼房”推出半天即被“秒杀”的新闻传出，有了诸多奇葩事垫底，对充满疑点的“鸽笼房”有人感慨、有人理解，却单单没有人质疑。</p><p>此事最大的疑点在于，开发商用以促销的手段——买“鸽笼”送厨房和卫生间。开发商为什么不把厨卫的面积算进销售面积？目前的调查显示，涉事<a href=\"http://house.ifeng.com/loupan/gongyu/list_0/0.shtml\" target=\"_blank\">公寓</a>早在2004年就已经建成，在2007年就办理了房地产登记，此次是原有产权人委托相关公司对公寓重新<a href=\"http://home.ifeng.com/listpage/14581/1/list.shtml\" target=\"_blank\">装修</a>后，再次向社会销售。开发商推出的多套“鸽笼房”，是在重新装修过程中通过挤占公摊面积，由原来的边角改扩建而成。开发商擅自侵占了原本属于全体业主的空间，并将此高价卖出，这笔交易当然见不得阳光，因此厨卫也无法算进销售面积并写进合同和房产证。在整个过程中，业主的整体利益受到损害，而购买“鸽笼”者则有近一半面积的产权无法得到法律保护，只有开发商大发利市，不仅白白赚得几百万元利润，另外还坐享媒体免费广告带来的销售业绩。</p><p>原标题：不能让奸商在楼市浑水摸鱼</p><p>深圳“鸽笼房”事件让公众看到，值此楼市风云变幻之际，在其中浑水摸鱼的奸商着实不少。<a href=\"http://house.ifeng.com/special/gaofangjiaganbuzouyetuzi/\" target=\"_blank\">高房价</a>不能成为作奸犯科的理由，更不能成为不法行为的掩护，监管部门必须加大力度规范楼市秩序，严惩热点事件中的相关责任人，坚决遏制炒作歪风。</p><p>“深圳6平方米鸽笼房半天售罄，均价15万每平方米”。针对此事，深圳市规划国土委26日通报了相关情况，称所涉11套6平方米的房产户型与规划验收竣工图不符，实际在售面积12平方米左右（其中一套约20平方米），超过部分占用了建筑公摊面积，涉嫌违法改建销售。深圳市有关部门已约谈当事人，对涉嫌违法违规行为责令立即整改，并按照职责分工依法做出相应处理。（相关报道见A14版）</p><p>深圳“鸽笼房”的新闻近日被炒得沸沸扬扬，之所以引人关注，首先在于“鸽笼房”的尺寸挑战了人们想象力的极限，一张双人床也有近4平方米大小，6平方米的“鸽笼房”几乎做到了极致，难怪会引人侧面。楼市出奇葩，今年特别多，上海的离婚购房潮，杭州的抢房大作战，上市公司的卖房保命等等。楼市风起云涌搞得人心浮躁，有人卖房变现千万离场，有人借高利贷当<a href=\"http://house.ifeng.com/news/touzi/detail_2010_03/31/444788_0.shtml\" target=\"_blank\">首付</a>进场，而大多数人则是左右彷徨、进退无据。就在此时，“鸽笼房”推出半天即被“秒杀”的新闻传出，有了诸多奇葩事垫底，对充满疑点的“鸽笼房”有人感慨、有人理解，却单单没有人质疑。</p><p>此事最大的疑点在于，开发商用以促销的手段——买“鸽笼”送厨房和卫生间。开发商为什么不把厨卫的面积算进销售面积？目前的调查显示，涉事<a href=\"http://house.ifeng.com/loupan/gongyu/list_0/0.shtml\" target=\"_blank\">公寓</a>早在2004年就已经建成，在2007年就办理了房地产登记，此次是原有产权人委托相关公司对公寓重新<a href=\"http://home.ifeng.com/listpage/14581/1/list.shtml\" target=\"_blank\">装修</a>后，再次向社会销售。开发商推出的多套“鸽笼房”，是在重新装修过程中通过挤占公摊面积，由原来的边角改扩建而成。开发商擅自侵占了原本属于全体业主的空间，并将此高价卖出，这笔交易当然见不得阳光，因此厨卫也无法算进销售面积并写进合同和房产证。在整个过程中，业主的整体利益受到损害，而购买“鸽笼”者则有近一半面积的产权无法得到法律保护，只有开发商大发利市，不仅白白赚得几百万元利润，另外还坐享媒体免费广告带来的销售业绩。</p><p>原标题：不能让奸商在楼市浑水摸鱼</p><p>深圳“鸽笼房”事件让公众看到，值此楼市风云变幻之际，在其中浑水摸鱼的奸商着实不少。<a href=\"http://house.ifeng.com/special/gaofangjiaganbuzouyetuzi/\" target=\"_blank\">高房价</a>不能成为作奸犯科的理由，更不能成为不法行为的掩护，监管部门必须加大力度规范楼市秩序，严惩热点事件中的相关责任人，坚决遏制炒作歪风。</p><p>“深圳6平方米鸽笼房半天售罄，均价15万每平方米”。针对此事，深圳市规划国土委26日通报了相关情况，称所涉11套6平方米的房产户型与规划验收竣工图不符，实际在售面积12平方米左右（其中一套约20平方米），超过部分占用了建筑公摊面积，涉嫌违法改建销售。深圳市有关部门已约谈当事人，对涉嫌违法违规行为责令立即整改，并按照职责分工依法做出相应处理。（相关报道见A14版）</p><p>深圳“鸽笼房”的新闻近日被炒得沸沸扬扬，之所以引人关注，首先在于“鸽笼房”的尺寸挑战了人们想象力的极限，一张双人床也有近4平方米大小，6平方米的“鸽笼房”几乎做到了极致，难怪会引人侧面。楼市出奇葩，今年特别多，上海的离婚购房潮，杭州的抢房大作战，上市公司的卖房保命等等。楼市风起云涌搞得人心浮躁，有人卖房变现千万离场，有人借高利贷当<a href=\"http://house.ifeng.com/news/touzi/detail_2010_03/31/444788_0.shtml\" target=\"_blank\">首付</a>进场，而大多数人则是左右彷徨、进退无据。就在此时，“鸽笼房”推出半天即被“秒杀”的新闻传出，有了诸多奇葩事垫底，对充满疑点的“鸽笼房”有人感慨、有人理解，却单单没有人质疑。</p><p>此事最大的疑点在于，开发商用以促销的手段——买“鸽笼”送厨房和卫生间。开发商为什么不把厨卫的面积算进销售面积？目前的调查显示，涉事<a href=\"http://house.ifeng.com/loupan/gongyu/list_0/0.shtml\" target=\"_blank\">公寓</a>早在2004年就已经建成，在2007年就办理了房地产登记，此次是原有产权人委托相关公司对公寓重新<a href=\"http://home.ifeng.com/listpage/14581/1/list.shtml\" target=\"_blank\">装修</a>后，再次向社会销售。开发商推出的多套“鸽笼房”，是在重新装修过程中通过挤占公摊面积，由原来的边角改扩建而成。开发商擅自侵占了原本属于全体业主的空间，并将此高价卖出，这笔交易当然见不得阳光，因此厨卫也无法算进销售面积并写进合同和房产证。在整个过程中，业主的整体利益受到损害，而购买“鸽笼”者则有近一半面积的产权无法得到法律保护，只有开发商大发利市，不仅白