INSERT INTO `m_intimate_new` VALUES ('293', 'sadsad', null, 'asdsads', '/geekdol/hmedia/upload/image/20160928/222095f3-b180-4b7b-96b6-7b31b3a36732.jpg', '0', '2016-09-28 17:39:56', '<p>新华社北京9月27日电 日前，中央纪委公开曝光6起违反中央八项规定精神典型问题，分别是：</p><p>　　黑龙江省鹤岗市委原副书记刘福等人违规组织、参加公款宴请问题。2015年8月9日，刘福在鹤岗市政府驻哈尔滨办事处宴请4名同事，菜品有佛跳墙、刺身三文鱼等和2瓶茅台酒，共计花费4498元。按照刘福要求，宴请费用由驻哈尔滨办事处处理。刘福受到党内严重警告处分、补交了宴请费用，其他相关人员受到相应纪律处分。</p><p>　　湖北省监利县公安局党委委员、副局长顾忠国违规公款吃喝等问题。2015年春节前后，顾忠国4次接待同学、朋友就餐，共计2160元，均未开具发票。2015年5月，顾忠国用一张品名为电脑主板和打印机配件、金额为2160元的武汉某商场发票在县公安局财务报销，以冲抵前述就餐费用。顾忠国受到党内警告处分，退交违规报销费用。</p><p>　　山东省齐鲁师范学院党委原副书记李良斋等人公款出国旅游问题。2015年2月28日至3月7日，李良斋等人组成访问团，赴德国、奥地利进行院校交流。该学院国际交流合作处擅自变更路线，增加赴比利时、法国等地的景点游览行程，李良斋表示同意。出访期间，仅安排1天半公务活动，其余时间赴德国海德堡和科隆、比利时布鲁塞尔、法国巴黎等地景点游览。上述活动费用共计17．02万元，其中旅游费用3．95万元。回国后，访问团按李良斋要求上报虚假出访报告。李良斋受到党内严重警告处分，被免去学院党委副书记职务，访问团成员补交旅游费用。</p><p>　　贵州省贵阳市水利水电工程移民局系统多人借公务差旅之机旅游问题。2015年3月19日，乌当区水利水电工程移民局副局长沈成贵、规划科科长李智宇、财务人员张帆芳，南明区水利水电工程移民局业务科科长刘锋、工作人员吕倩若，开阳县水利水电工程移民局财务审计科科长贺平惠等6人到福建省厦门市参加单位选派的业务培训。3月22日培训结束后，沈成贵等人在厦门市游玩至27日返回贵阳，并将游玩期间的住宿费在单位报销。沈成贵、李智宇、张帆芳、贺平惠分别受到党内警告处分；刘锋、吕倩若分别受到行政警告处分。相关责任人均退交了旅游费用。</p><p>　　海南省东方市华侨经济区管委会副主任李秀琴、华侨农场橡胶加工厂原厂长王建平夫妇大办儿子婚宴问题。2016年1月20日，李秀琴、王建平夫妇向市华侨经济区管委会申请操办儿子婚宴，申请桌数10桌，时间为1月31日，地点为东方市某大酒店。当天，李秀琴、王建平分别在该大酒店和某喜庆广场操办儿子婚宴，其中大酒店酒席桌数为10桌、喜庆广场桌数为29桌，合计39桌，违规收受礼金3．89万元。李秀琴受到党内严重警告、行政记过处分，王建平受到行政记过处分、不再聘任其为华侨农场橡胶加工厂厂长，违规收受礼金被收缴。</p><p><ins class=\"sinaads sinaads-done\" id=\"Sinads49447\" style=\"display: block; overflow: hidden; text-decoration: none;\"><ins style=\"text-decoration:none;margin:0px auto;width:300px;display:block;position:relative;overflow:hidden;\"></ins></ins></p><p>　　吉林省辽源矿业集团泵业有限责任公司原董事长王仁清，原党委书记、纪委书记毕远波违规发放奖金问题。2013年至2015年7月，泵业有限责任公司以培训授课名义从公司教育经费中提取资金，给公司班子成员及部分科室负责人和职工发放奖金，累计发放141人次，共计16．68万元。王仁清、毕远波明知以培训费名义发放奖金不符合规定，但未及时制止，且本人也参与领取奖金。王仁清、毕远波分别受到党内严重警告处分，违纪资金予以收缴。</p><p>　　中央纪委有关负责人指出，在当前高压态势之下，“四风”问题呈现新的形式和特点。这些党员、干部，明知中央有要求、纪律不允许，但仍我行我素，不知止不收敛，采取多种手法顶风违纪，触碰纪律红线，必须受到严肃处理。广大党员干部要引以为戒，牢固树立政治意识、大局意识、核心意识、看齐意识，深刻认识落实中央八项规定精神的重要性，切实增强遵规守纪的思想自觉和行动自觉。要坚决防止和纠正打“擦边球”、穿“隐身衣”、搞“变脸术”的“四风”问题，以永远在路上的恒心和韧劲，驰而不息落实中央八项规定精神。国庆假期将至，各地区各部门要加强工作部署和监督检查，加大监督执纪问责力度。对发现的问题，一律从严查处；对问题突出的地方和单位，严肃问责，决不姑息。</p><p><br/></p>', '0', '0', null, null, '0', null, null, null, '0', null, null, '0', '0', '0', '0', '0', '0', '0', '1', '2016-09-28 17:39:59', '1', '2016-09-28 17:39:59', '0', '0');
