INSERT INTO `m_netizen_acumen` VALUES ('32', '网络诈骗急待清理', '网络文章', '网络诈骗只是运用网络手段进行的诈骗行为，形式不同，本质都一样，根据刑法第266条诈骗罪是指以非法占有为目的，用虚构事实或者隐瞒真相的方法，骗取数额较大的公私财物的行为。 \r\n\r\n根据《最高人民法院关于审理诈骗案件具体应用法律的若干问题的解释》（1996年12月16日）的规定：个人诈骗公私财物2千元以上的，属于“数额较大”；个人诈骗公私财物3万元以上的，属于“数额巨大”。 但是它同时规定， 各省、自治区、直辖市高级人民法院可根据本地区经济发展状况，并考虑社会治安状况，在“2千元至4千元”、“3万元至5万元”的幅度内，分别确定本地区执行的个人诈骗“数额较大”、“数额巨大”，以及单位实施诈骗，追究有关人员刑事责任，参照本条第四款规定的数额，确定适用原《刑法》第151条或者第l52条的具体数额标准，并报最高人民法院备案。 所以，你可以结合你的省份的具体规定来看是否到达诈骗罪的程度，一般到达了都是要立案的。报案的对象可以是公安机关、网络监管机关或者进行购物的网站。\r\n', '01,02', '192.168.2.81', '18738316206', '1', '2016-09-08 10:44:57', '1', '2016-09-08 10:45:00', '0', '0', '河南省郑州市高新区凤阳社区升龙又一城');
