INSERT INTO `t_adm_newsflash` VALUES ('1', null, null, '<p>一、上Grandle官网下载Gradle,地址：<a title=\"http://www.gradle.org/downloads\" href=\"http://www.gradle.org/downloads\" target=\"_blank\">http://www.gradle.org/downloads</a></p><p><img src=\"http://images2015.cnblogs.com/blog/759025/201509/759025-20150913113157747-2143559473.png\" alt=\"\"/></p><p>如果只是运行只下载gradle-2.6-bin.zip 就<span style=\"line-height: 1.5;\">可以了</span><span style=\"line-height: 1.5;\">，如果为了扩展开发的话就下载</span><span style=\"line-height: 1.5;\">gradle-2.6-all.zip</span><span style=\"line-height: 1.5;\">。</span></p><p>二、下载完毕，直接把zip解压，放到你电脑的软件安装目录下，例如：D:Program Files</p><p>三、配置环境变量，在计算机---我的电脑设置环境变量，添加GRADLE_HOME指向gradle的安装目录的跟目录，例如：D:Program Filesgradle-2.6。然后需要在Path环境变量中加上gradle的bin目录，例如：D:Program Filesgradle-2.6in</p><p>四、以上步骤设置完毕，打开cmd，运行gradle -v就可以看到gradle的版本信息如下图，标志配置完成。</p><p><img src=\"http://images2015.cnblogs.com/blog/759025/201509/759025-20150913113711012-805583213.png\" alt=\"\"/></p><p>五、打开MyEclipse，Help--&gt;Install from site，输入<a title=\"http://dist.springsource.com/release/TOOLS/gradle\" href=\"http://dist.springsource.com/release/TOOLS/gradle\" target=\"_blank\">http://dist.springsource.com/release/TOOLS/gradle</a>，如图：</p><p><img src=\"http://images2015.cnblogs.com/blog/759025/201509/759025-20150913114106856-1647585123.png\" alt=\"\"/></p><p><br/>点击OK按钮，接下来如果提示找不到地址，估计是被墙掉了，需要FQ。如果找得到地址，选显示出来需要安装的项，如图：</p><p><img src=\"http://images2015.cnblogs.com/blog/759025/201509/759025-20150913114234169-482147569.png\" alt=\"\"/></p><p>然后一直按下一步，安装完毕，重启MyEclipse 就可以了。安装成功后在MyEclipse设置中就可以看到如下信息：</p><p><img src=\"http://images2015.cnblogs.com/blog/759025/201509/759025-20150913114414528-1991314274.png\" alt=\"\"/></p><p>&nbsp;</p><p>至此MyEclipse就完成了Gradle 环境的集成。</p><p>&nbsp;</p>', null, null, null, null, '101', null, null, null, null, '33', null, '12', null, null, null, null, null, null);
