INSERT INTO `t_city_district_notice` VALUES ('54', '关于市历史文化风貌特色村和市自然生态风貌特色村拟认定名单', '', null, '<p style=\"margin: 0px; padding: 0px; text-align: center; line-height: 50px; color: rgb(0, 102, 168); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">关于市历史文化风貌特色村和市自然生态风貌特色村拟认定名单的公示</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 30px; font-size: 14px; color: rgb(73, 73, 73); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp;为贯彻中央及省委、市委新型城镇化会议精神，在新型城镇化建设进程中切实保护好具有历史遗迹、郑州历史文化特色、 中原地区民居特色、生态空间特色的历史文化风貌特色村和自然生态风貌特色村庄，彰显我市新型城镇化建设的地方特色，根据《郑州市人民政府关于加强历史文化 风貌特色村和自然生态风貌特色村保护发展的意见》（郑政文﹝2014﹞153号）精神，经村委会自愿申报、乡（镇）政府推荐、县（市、区）政府初审、市新 型城镇化建设办公室组织相关人员进行实地核查，并经市规划、农委、建委、文物等相关部门审核，认定下列村庄符合市历史文化风貌特色村和自然生态风貌特色村 标准。为体现公开、公平、公正原则，现将拟评定为市历史文化风貌特色村和自然生态风貌特色村的名单向社会公示，征求社会意见，接受社会监督。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 30px; font-size: 14px; color: rgb(73, 73, 73); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　一、郑州市历史文化风貌特色村（共38个）：登封市君召乡黄城村、石坡爻村、君召村、胥店村，卢店镇景店村，徐庄镇柏石崖村，大金店镇大金店老 街，颍阳镇刘村、李洼村，中岳办事处北高庄村，少林街道办事处耿庄村；新密市米村镇范村，刘寨镇吕楼村，来集镇李堂村，苟堂镇方沟村，超化镇栗林村，城关 镇南街村，平陌镇香山村；荥阳市广武镇苏寨村、霸王城村、张河村，高村乡油坊村，汜水镇汜水村、口子村，豫龙镇赵家垌村、京襄城村，王村镇苌村，高山镇石 洞沟村，索河办事处城关村（老城），崔庙镇索坡村；新郑市辛店镇人和村，郭店镇华阳寨村；中牟县官渡镇官渡桥村，雁鸣湖镇朱固村；郑东新区杨桥办事处台肖 村、杨桥村；高新区双桥办事处岳岗行政村小双桥自然村，沟赵办事处西连河村。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 30px; font-size: 14px; color: rgb(73, 73, 73); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　二、郑州市自然生态风貌特色村（共28个）：登封市大冶镇周山村、垌头村、朝阳沟村，君召乡红石头沟村，颍阳镇宋爻村，白坪乡寨东村、寨西村、 程窑村、南窑村；新密市袁庄乡郑冲村，米村镇朱家庵村、金井沟村，牛店镇月台村，苟堂镇申门村，超化镇草庙村，岳村镇土门村；荥阳市高村乡刘沟村、竹川 村，豫龙镇毛砦村，环翠峪管委会二郎庙村，刘河镇王河村；新郑市龙湖镇泰山村，辛店镇北靳楼村；中牟县官渡镇十里铺村；二七区侯寨乡樱桃沟社区；金水区兴 达路办事处来童寨村；惠济区花园口镇石桥村；航空港区冯堂办事处高家村。</p><p><br/></p>', '2016-09-07 18:03:02', '99', '2016-09-07 18:27:03', '1', '16', '0', null, null, '2', '02', '99', '2016-09-07 18:08:13', '99', '2016-09-07 18:27:03', '22', '0');
INSERT INTO `t_city_district_notice` VALUES ('55', '关于严厉打击各类违法建设行为的通告', '', null, '<p style=\"margin: 0px; padding: 0px; text-align: center; line-height: 50px; color: rgb(0, 102, 168); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">关于严厉打击各类违法建设行为的通告</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 30px; font-size: 14px; color: rgb(73, 73, 73); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">为切实维护《中华人民共和国城乡规划法》、《中华人民共和国土地管理法》、《中华人民共和国建筑法》等法律法规的严肃性,规范我市经济发展秩序,维护广大居民的正当权益,遏制建筑、消防等安全事故发生,严厉打击各类违法建设行为,特发通告如下:<br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 30px; font-size: 14px; color: rgb(73, 73, 73); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　一、凡没有法定规划设计条件和规划设计要求或不按规划设计条件和设计要求进行违法设计的设计单位,由各级城乡规划主管部门依据《城乡规划编制单位资质管理规定》等规定,责令限期改正,处以罚款;情节严重的,责令停业整顿,降低资质等级或者吊销资质证书。构成犯罪的,依法移交司法、公安等相关部门追究其刑事责任。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 30px; font-size: 14px; color: rgb(73, 73, 73); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　二、凡未取得建设行政主管部门施工许可或不按许可内容进行施工的施工单位,各级建设行政主管部门自查处之日起将施工单位列黑名单,记录不良行为记录2年,并停止办理竣工验收备案等事宜。对违法情节严重的施工单位,市建设行政主管部门建议上级行政主管部门取消或降低其施工资质,直至司法、公安等相关部门追究其法人代表的刑事责任。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 30px; font-size: 14px; color: rgb(73, 73, 73); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　三、涉及违法用地的,各级国土资源管理部门要依法从严从快予以查处。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 30px; font-size: 14px; color: rgb(73, 73, 73); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　四、对进行违法建设的房地产开发企业,各级房地产主管部门要建立黑名单制,按照行政管理权限依法作出或建议上级行政主管部门作出降低其资质或取缔资质的决定。对各类违法建筑,各级房地产行政管理部门不得为其办理任何形式的房产证件、证明。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 30px; font-size: 14px; color: rgb(73, 73, 73); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　五、对各类违法建设,在实施城乡规划建设拆迁安置中不予补偿和安置。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 30px; font-size: 14px; color: rgb(73, 73, 73); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　六、各级工商、税务、卫生、食安、公安等行政主管部门要严格按照国家工商总局《内资企业登记提交材料规范》和《内资企业登记文书规范》(工商企字〔2009〕83号)等相关文件规定,对不能出具合法的建设工程规划许可证、施工许可证、房屋所有权证的建筑,通告相关行政主管部门依法处理。待依法处理终结后,方可办理相关行政许可。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 30px; font-size: 14px; color: rgb(73, 73, 73); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　七、各类违法建设责任单位、责任人除承担违法建设法律责任外,擅自出售、出租违法建筑等发生建筑、消防等安全事故的,要承担其法律责任,购买和租赁违法建设的不受法律保护。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 30px; font-size: 14px; color: rgb(73, 73, 73); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　八、全市各级相关行政管理部门和行政执法人员出现失职、渎职、徇私舞弊、以权谋私等违法违规、违纪行为的,要依法依纪从严追究党政纪责任,构成犯罪的,移交司法机关依法追究其刑事责任。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 30px; font-size: 14px; color: rgb(73, 73, 73); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　九、本通告自发布之日起实施。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 30px; font-size: 14px; color: rgb(73, 73, 73); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　特此通告。</p><p><br/></p>', '2016-09-07 18:14:32', '99', '2016-09-07 18:14:37', '1', '3', '0', null, null, '2', '02', '99', '2016-09-07 18:14:37', '99', '2016-09-07 18:14:37', '3', '0');
INSERT INTO `t_city_district_notice` VALUES ('56', '关于2016年中秋节放假安排的通知', '', null, '<p style=\"text-align: center;\">关于2016年中秋节放假安排的通知</p><p>&nbsp; 各县（市、区）人民政府，市人民政府各部门，各有关单位：</p><p>&nbsp; 根据省政府办公厅通知精神，为便于各地、各单位及早合理安排工作，现将2016年中秋节放假调休日期安排通知如下:</p><p>&nbsp; 9月15日至17日放假调休，共3天。9月18日（星期日）上班。</p><p>&nbsp; 节假日期间，各地、各部门要妥善安排好值班和安全、保卫等工作，遇有突发事件，要按规定及时报告并妥善处置，确保人民群众祥和平安度过节日假期。</p><p><br/></p>', '2016-09-07 18:16:35', '99', '2016-09-07 18:17:23', '1', '2', '0', null, null, '2', '02', '99', '2016-09-07 18:17:23', '99', '2016-09-07 18:17:23', '2', '0');
INSERT INTO `t_city_district_notice` VALUES ('57', '征求意见稿', '', null, '<p style=\"text-align: center;\">关于《郑州市城市供水管理条例实施细则（征求意见稿）》向社会征求意见</p><p><br/></p><p>&nbsp; 为加强城市供水管理，保障城市生活、生产用水和其他各项建设用水，按照政府规章年度立法计划，根据《郑州市城市供水管理条例》等有关法律、法规，由市城管局起草、经市政府法制办审查、修改，形成了《郑州市城市供水管理条例实施细则（征求意见稿）》。</p><p>&nbsp; 为进一步增强政府立法的公开性和透明度，推进民主立法、科学立法，提高政府立法质量，根据国务院《立法法》和《郑州市制定政府规章和拟定地方性法规草案程序规定》（市政府令第188号）等有关规定，现将《郑州市城市供水管理条例实施细则（征求意见稿）》全文公布，广泛征求意见。如有意见和建议，请通过下列方式反馈至市政府法制办。</p><p>传&nbsp;&nbsp;&nbsp; 真：0371－67446680</p><p>电子信箱：lifazhengqiuyijian@126.com</p><p>通讯地址：郑州市中原西路233号市政府法制办法规处&nbsp;&nbsp;&nbsp;&nbsp; 邮编：450006</p><p>附件：《郑州市城市供水管理条例实施细则（征求意见稿）》</p><p><br/></p>', '2016-09-07 18:17:48', '99', '2016-09-07 18:26:29', '1', '6', '0', null, null, '2', '02', '99', '2016-09-07 18:18:44', '99', '2016-09-07 18:26:29', '14', '0');
INSERT INTO `t_city_district_notice` VALUES ('58', '中原区举办“服务百姓健康行动”大型义诊活动', '', null, '<p style=\"text-align: center;\">中原区举办“服务百姓健康行动”大型义诊活动</p>&nbsp; &nbsp;9月3日，由郑州市卫计委主办、中原区卫计委承办的2016年郑州市“服务百姓健康行动”大型义诊活动在绿城广场如期举行。全市集中义诊活动现场有市中心医院、市人民医院、市妇幼保健院、市骨科医院等15家医院300余名医护人员参与。<br/>　　活动现场，医护人员为大家免费量血压、测血糖，讲解了高血压、糖尿病的危害及防治，并对慢性患者给予饮食、用药建议，吸引了大批群众参与，现场接诊区域内的患者络绎不绝，排队等候专家看诊。市人民医院医务人员现场为居民进行心胸肺复苏急救方法的演示，并对群众耐心讲解了关于生活中急救知识等问题。参与义诊的医院纷纷为前来咨询的居民讲解日常保健和疾病预防知识，并发放健康科普宣传资料，受益群众约3000人次。<br/>　　此次义诊活动方便了市民在家门口看病就医，让居民足不出户就可以享受免费的医疗与服务，提高群众的健康知识水平，增强居民的健康保护意识，受到大家一致好评。', '2016-09-07 18:21:20', '99', '2016-09-07 18:22:40', '1', '1', '0', null, null, '2', '02', '99', '2016-09-07 18:22:40', '99', '2016-09-07 18:22:40', '1', '0');
INSERT INTO `t_city_district_notice` VALUES ('59', '2016中华枣乡风情游暨好想你红枣文化节开幕', '', null, '<p style=\"text-align: center;\">2016中华枣乡风情游暨好想你红枣文化节开幕</p><p>&nbsp; 七月十五枣红鼻，八月十五枣红腚。9月3日上午，2016中华枣乡风情游暨第十四届好想你红枣文化节隆重开幕。今年的“中华枣乡风情游”活动，由郑州市旅游局和新郑市人民政府联合主办，新郑市旅游文物局、薛店镇人民政府、孟庄镇人民政府、好想你枣业股份有限公司共同承办。今年的活动以“感恩 健康 快乐”为主题，活动将持续到“十一”黄金周结束。</p><p>&nbsp; 开幕式上，中央电视台军事农业频道CCTV7《乡约》栏目走进枣乡，为新郑小伙和年轻姑娘搭建平台，寻找真爱。精彩纷呈，各具特色的本土节目轮番上演，将开幕式推向一个又一个高潮。</p><p>&nbsp; 四面八方的游客们慕名而来，纷纷徜徉在枣树林中。鸡心枣、灰枣、葫芦枣、磨盘枣等众多枣品让游客们应接不暇。大家采摘鲜枣进行品尝，并拍照留念，与枣农一同分享秋实之乐。</p><p>&nbsp; 活动期间，游客既可到各园区采摘品尝金秋红枣，购买农产品、吃农家饭、住农家院，帮农民致富，享受农家美味，体验农家乐趣，也可带着孩子走进好想你金鹭鸵鸟园重温童年时光，也可以到枣文化博物馆熟知万种红枣的今生前世，从而全面提升活动观赏性、趣味性、娱乐性与参与性。创新、丰富的活动内容，让大家在为期一个月的时间里深切体验回归自然、回归乡土的节约生活，尽情享受美景如画的。</p><p>&nbsp; 枣园风光，全面领略源远流长的枣乡文化，进一步弘扬新郑红枣文化，助推红枣产业快速发展，实现旅游产业与红枣产业产业共赢。</p><p><br/></p>', '2016-09-07 18:23:48', '99', '2016-09-07 18:24:35', '1', '5', '0', null, null, '2', '02', '99', '2016-09-07 18:24:35', '99', '2016-09-07 18:24:35', '5', '0');
INSERT INTO `t_city_district_notice` VALUES ('60', '2016年郑州高新区管委会事业单位招聘面试确认公告', '', null, '<p style=\"border: 0px none; font-size: 22px; margin: 0px; outline: none 0px; padding: 0px; height: 72px; line-height: 72px; text-align: center; color: rgb(51, 51, 51); overflow: hidden; font-family: Simsun; white-space: normal;\">2016年郑州高新区管委会事业单位招聘面试确认公告</p><p style=\"border: 0px none; font-size: 14px; margin: 10px auto 0px; outline: none 0px; padding: 0px; line-height: 30px; font-family: 宋体; white-space: normal;\">&nbsp; 2016年郑州高新区管委会事业单位招聘开始了，详情请看本文“2016年郑州高新区管委会事业单位招聘面试确认公告”由出国留学网<a href=\"http://www.liuxue86.com/gongwuyuan/\" target=\"_blank\" style=\"border: 0px none; margin: 0px; outline: none medium; padding: 0px; text-decoration: none; color: rgb(51, 51, 51); cursor: pointer;\">公务员考试</a>网整理而出，希望能帮到您！</p><p style=\"border: 0px none; font-size: 14px; margin: 10px auto 0px; outline: none 0px; padding: 0px; line-height: 30px; font-family: 宋体; white-space: normal;\">　　根据《郑州高新技术产业开发区管委会2016年公开招聘机关事业单位工作人员公告》，现将郑州高新区管委会2016年公开招聘机关事业单位工作人员面试资格确认有关事宜公告如下：</p><p style=\"border: 0px none; font-size: 14px; margin: 10px auto 0px; outline: none 0px; padding: 0px; line-height: 30px; font-family: 宋体; white-space: normal;\">　　<strong style=\"border: 0px none; margin: 0px; outline: none 0px; padding: 0px; color: rgb(51, 51, 51);\">一、进入面试资格确认人员名单</strong></p><p style=\"border: 0px none; font-size: 14px; margin: 10px auto 0px; outline: none 0px; padding: 0px; line-height: 30px; font-family: 宋体; white-space: normal;\">　　经岗位调整后，本次拟招聘机关事业单位工作人员98人，根据笔试成绩(含加分因素)，按拟招聘名额1:3的比例从高分到低分确定进入面试资格确认环节297人(含笔试成绩并列者)。另有24名博士符合免笔试条件，直接进入面试。共计321人进入面试资格确认环节，具体名单详见附件。</p><p style=\"border: 0px none; font-size: 14px; margin: 10px auto 0px; outline: none 0px; padding: 0px; line-height: 30px; font-family: 宋体; white-space: normal;\">　<strong style=\"border: 0px none; margin: 0px; outline: none 0px; padding: 0px; color: rgb(51, 51, 51);\">　二、面试资格确认有关具体事宜</strong></p><p style=\"border: 0px none; font-size: 14px; margin: 10px auto 0px; outline: none 0px; padding: 0px; line-height: 30px; font-family: 宋体; white-space: normal;\">　　1.面试资格确认时间：2016年4月26日(上午8：30—12:00，下午14:00—18：30)</p><p style=\"border: 0px none; font-size: 14px; margin: 10px auto 0px; outline: none 0px; padding: 0px; line-height: 30px; font-family: 宋体; white-space: normal;\">　　2.面试资格确认地点：郑州市中原区伊河路嵩山饭店大礼堂二楼东侧会议室</p><p style=\"border: 0px none; font-size: 14px; margin: 10px auto 0px; outline: none 0px; padding: 0px; line-height: 30px; font-family: 宋体; white-space: normal;\">　　3. 面试资格确认须携带材料：考生持本人有效期内的二代身份证、信息表、笔试准考证、毕业证、学位证(2016年应届毕业生须提供《毕业生推荐表(函)》)、教育部学历证书电子注册备案表、就业报到证、报名表等相关资格证件原件及复印件一式两份接受面试资格确认。</p><p style=\"border: 0px none; font-size: 14px; margin: 10px auto 0px; outline: none 0px; padding: 0px; line-height: 30px; font-family: 宋体; white-space: normal;\">　　拟面试考生为留学回国人员的，还须持我国驻外使(领)馆教育(文化)处(组)出具的留学回国人员证明、教育部留学服务中心出具的国外学历学位认证书等相关证件。</p><p style=\"border: 0px none; font-size: 14px; margin: 10px auto 0px; outline: none 0px; padding: 0px; line-height: 30px; font-family: 宋体; white-space: normal;\">　　拟面试考生是在职人员的，还须提供所在单位同意报考的证明。</p><p style=\"border: 0px none; font-size: 14px; margin: 10px auto 0px; outline: none 0px; padding: 0px; line-height: 30px; font-family: 宋体; white-space: normal;\">　<strong style=\"border: 0px none; margin: 0px; outline: none 0px; padding: 0px; color: rgb(51, 51, 51);\">　三、注意事项</strong></p><p style=\"border: 0px none; font-size: 14px; margin: 10px auto 0px; outline: none 0px; padding: 0px; line-height: 30px; font-family: 宋体; white-space: normal;\">　　1.进入面试资格确认环节考生经审查合格后，现场领取《面试通知单》。</p><p style=\"border: 0px none; font-size: 14px; margin: 10px auto 0px; outline: none 0px; padding: 0px; line-height: 30px; font-family: 宋体; white-space: normal;\">　　2.根据面试资格确认审查结果和《郑州高新技术产业开发区管委会2016年公开招聘机关事业单位工作人员公告》规定，如因考生本人自动放弃或被取消面试资格而造成达不到1：3面试比例的，经郑州高新区管委会2016年公开招聘机关事业单位工作人员领导小组研究，可按照笔试成绩由高分到低分的顺序依次递补。</p><p style=\"border: 0px none; font-size: 14px; margin: 10px auto 0px; outline: none 0px; padding: 0px; line-height: 30px; font-family: 宋体; white-space: normal;\">　　3.根据《郑州高新区管委会2016年公开招聘机关事业单位工作人员公告》要求，博士研究生参加此次公开招聘的，可以免笔试直接进入面试，其笔试成绩按照相同专业岗位进入面试人员的笔试平均成绩计算;如选择参加笔试，其笔试成绩必须以本人笔试考试分数为准。</p><p style=\"border: 0px none; font-size: 14px; margin: 10px auto 0px; outline: none 0px; padding: 0px; line-height: 30px; font-family: 宋体; white-space: normal;\">　　4.考生必须本人按规定时间和地点进行面试资格确认，不得他人代替。本人逾期不进行面试资格确认或不提交相关证明材料的，视为自动放弃面试资格。</p><p style=\"border: 0px none; font-size: 14px; margin: 10px auto 0px; outline: none 0px; padding: 0px; line-height: 30px; font-family: 宋体; white-space: normal;\">　　5.符合免笔试条件人员同时也需进行面试资格确认。</p><p style=\"border: 0px none; font-size: 14px; margin: 10px auto 0px; outline: none 0px; padding: 0px; line-height: 30px; font-family: 宋体; white-space: normal;\">　　6.资格审查贯穿招聘全过程，凡一经发现不符合招聘条件，弄虚作假或违反招聘规定的，取消其聘用资格。</p><p style=\"border: 0px none; font-size: 14px; margin: 10px auto 0px; outline: none 0px; padding: 0px; line-height: 30px; font-family: 宋体; white-space: normal;\">　　7.请进入面试资格确认环节的考生及时关注招考网站公告，并保持通讯畅通。</p>', '2016-09-07 18:30:08', '99', '2016-09-07 18:31:46', '1', '2', '0', null, null, '2', '03', '99', '2016-09-07 18:31:46', '99', '2016-09-07 18:31:46', '2', '0');
INSERT INTO `t_city_district_notice` VALUES ('61', '关于组织申报2016年河南省产业技术创新战略联盟的通知', '', null, '<p style=\"text-align: center;\">关于组织申报2016年河南省产业技术创新战略联盟的通知</p><p>区内各企业：<br style=\"padding: 0px; margin: 0px;\"/>&nbsp;&nbsp;&nbsp; 为深入实施创新驱动发展战略，推进我省产业技术创新战略联盟建设，决定开展2016年河南省产业技术创新战略联盟申报工作。根据《河南省产业技术创新战略联盟构建与发展实施办法》（豫科〔2013〕146号）的要求，现将有关事项通知如下：<br style=\"padding: 0px; margin: 0px;\"/>&nbsp;&nbsp;&nbsp;&nbsp;一、支持范围<br style=\"padding: 0px; margin: 0px;\"/>&nbsp;&nbsp;&nbsp; 围绕培育壮大战略性新兴产业、改造提升传统产业、发展现代服务业等重大技术创新需求，重点在装备制造、新一代信息技术、新能源、功能性新材料、生物医药、节能环保、资源综合利用、现代农业等重点领域开展联盟建设。<br style=\"padding: 0px; margin: 0px;\"/>&nbsp;&nbsp;&nbsp;&nbsp;二、申报要求<br style=\"padding: 0px; margin: 0px;\"/>&nbsp;&nbsp;&nbsp; （一）申报条件<br style=\"padding: 0px; margin: 0px;\"/>&nbsp;&nbsp;&nbsp; 1.申报联盟需满足以下基本条件：<br style=\"padding: 0px; margin: 0px;\"/>&nbsp;&nbsp;&nbsp; （1）突出战略重点。联盟应以推进我省重点产业技术创新能力，提升我省产业核心竞争力为目标，体现所在产业领域的重大技术创新需求，有利于集聚创新资源推动相关产业实现重大技术突破，形成产业核心技术标准，带动产业技术创新，促进产业结构优化升级。<br style=\"padding: 0px; margin: 0px;\"/>&nbsp;&nbsp;&nbsp; （2）坚持市场导向。联盟的构建以产业发展需求和各方共同利益为基础，在平等、自愿的前提下，实现企业、高等院校、科研机构的资金、人才、技术等创新资源优化配置和创新要素高效集成。<br style=\"padding: 0px; margin: 0px;\"/>&nbsp;&nbsp;&nbsp; （3）强化顶层设计。联盟的构建应加强产业链宏观布局，围绕产业链组织创新链、完善资金链，明确产业发展的重点方向和关键领域，探索高效的协同创新和组织机制，开展产业技术协同创新，提升产业链整体创新能力和综合竞争实力。<br style=\"padding: 0px; margin: 0px;\"/>&nbsp;&nbsp;&nbsp; 2.联盟牵头及成员单位须具备以下基本条件：<br style=\"padding: 0px; margin: 0px;\"/>&nbsp;&nbsp;&nbsp; （1）联盟构建牵头单位是在河南省内注册的独立法人单位，整体技术水平应居于省内领先、国内先进地位，具备较大规模和较强的研发实力，能够集聚相关产业创新资源，支撑和引领产业发展，具有较强的辐射带动作用或发展潜力。<br style=\"padding: 0px; margin: 0px;\"/>&nbsp;&nbsp;&nbsp; （2）联盟成员单位以河南本省的法人单位为主，允许部分省外单位作为成员单位参与联盟构建。联盟成员单位是企业的应处于行业骨干地位，具备一定规模，注重关键技术的研发和创新；成员单位是高等院校、科研院所及机构的应处于行业技术研发先进水平，拥有自主知识产权的核心技术或相关专利。<br style=\"padding: 0px; margin: 0px;\"/>&nbsp;&nbsp;&nbsp; （3）联盟成员单位数量原则上不低于10家，建有产业领域相关的省级研发平台不低于3家。<br style=\"padding: 0px; margin: 0px;\"/>&nbsp;&nbsp;&nbsp; （二）申报材料<br style=\"padding: 0px; margin: 0px;\"/>&nbsp;&nbsp;&nbsp; 1.《河南省产业技术创新战略联盟构建建议书》<br style=\"padding: 0px; margin: 0px;\"/>&nbsp;&nbsp;&nbsp; 2.《河南省产业技术创新战略联盟构建可行性研究报告》<br style=\"padding: 0px; margin: 0px;\"/>&nbsp;&nbsp;&nbsp; 3.《2016年度河南省产业技术创新战略联盟推荐表》<br style=\"padding: 0px; margin: 0px;\"/>&nbsp;&nbsp;&nbsp;&nbsp;三、申报程序<br style=\"padding: 0px; margin: 0px;\"/>&nbsp;&nbsp;&nbsp; （一）申报单位登录“河南省科技业务综合管理平台（<a href=\"http://xm.hnkjt.gov.cn/\" style=\"padding: 0px; margin: 0px; color: rgb(0, 0, 0); text-decoration: none;\">http://xm.hnkjt.gov.cn/</a>）”填写申报材料，并上传相关附件。系统填报时间为8月29日至9月21日。<br style=\"padding: 0px; margin: 0px;\"/>&nbsp;&nbsp;&nbsp; （二）纸质申报材料由系统生成PDF文档打印（相关附件材料附后），书籍式装订后报送主管部门（单位）审核盖章。<br style=\"padding: 0px; margin: 0px;\"/>&nbsp;&nbsp;&nbsp; （三）推荐部门对审核通过后进行网上提交，并在系统生成的推荐表上盖章确认，连同申报材料（一式两份）报送省科技厅，逾期不予受理。<br style=\"padding: 0px; margin: 0px;\"/>&nbsp;&nbsp;&nbsp;&nbsp;四、郑州高新区主管部门申报时间和地点<br style=\"padding: 0px; margin: 0px;\"/>&nbsp;&nbsp;&nbsp; 申报时间：9月19日前，逾期不予受理<br style=\"padding: 0px; margin: 0px;\"/>&nbsp;&nbsp;&nbsp; 申报地点：郑州高新区管委会3楼科技局西办公室<br style=\"padding: 0px; margin: 0px;\"/>&nbsp;&nbsp;&nbsp; 联 系 人：材料受理人 &nbsp; &nbsp; &nbsp;石 &nbsp;岩 &nbsp; &nbsp; &nbsp; &nbsp;67983663</p><p>&nbsp; &nbsp; &nbsp;申报系统技术支持 &nbsp; &nbsp; &nbsp; &nbsp; 张德杨 &nbsp; &nbsp; &nbsp; &nbsp;0371-65831885</p><p><br/></p>', '2016-09-07 18:32:54', '99', '2016-09-07 18:34:22', '1', '2', '0', null, null, '2', '03', '99', '2016-09-07 18:34:22', '99', '2016-09-07 18:34:22', '2', '0');
INSERT INTO `t_city_district_notice` VALUES ('62', '高新区经发局关于启动应急保障措施的通知', '', null, '<p style=\"text-align: center;\">高新区经发局关于启动应急保障措施的通知</p><p><span style=\"font-family: Simsun; font-size: 12px; line-height: 18px; background-color: rgb(255, 255, 255);\">&nbsp;接郑州市大气办通知：为遏制当前我市空气质量恶化趋势，切实做好我市环境空气质量保障工作，经市领导研究，决定在全市启动应急保障。高新区经发局按照《郑州市环境空气质量保障工作方案》（郑防领办〔2016〕49号）和郑工信能源〔2016〕20号文件要求，启动应急保障措施：严格控制各类高架源排放，未达到超低排放标准的燃煤电厂按要求采取限产减排措施。 各办事处、各企业要高度重视此项工作，</span><span style=\"font-family: Verdana; font-size: 12px;\">排污单位控制产污工序生产，减少大气污染物排放；化工、钢铁、水泥等大气污染物排放量大的企业，根据大气污染情况适当调整产能，减少污染物排放。</span></p>', '2016-09-07 18:35:24', '99', '2016-09-07 18:36:07', '1', '2', '0', null, null, '2', '03', '99', '2016-09-07 18:36:07', '99', '2016-09-07 18:36:07', '2', '0');
INSERT INTO `t_city_district_notice` VALUES ('63', '高新区举办公共文明基本常识知识竞赛活动', '', null, '<p style=\"margin: 20px 0px; padding: 0px; font-family: 微软雅黑; text-align: center; color: rgb(88, 88, 88); line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\">高新区举办公共文明基本常识知识竞赛活动<br/></p><p>&nbsp; <span style=\"font-family: Simsun; font-size: 12px; line-height: 18px; background-color: rgb(255, 255, 255);\">为弘扬文明礼仪传统美德，广泛普及公共文明基本礼仪知识，展现高新人讲文明、重礼仪的良好形象，9月5日下午，高新区公 文明基本常识知识竞赛在管委会多功能厅成功举办。区党工委副书记李金勇，管委办公室、创建办等主要负责人现场观看比赛。</span><br style=\"padding: 0px; margin: 0px; font-family: Simsun; font-size: 12px; line-height: 18px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"font-family: Simsun; font-size: 12px; line-height: 18px; background-color: rgb(255, 255, 255);\">&nbsp; 本次知识竞赛活动以提升城乡居民文明素质和城乡文明程度为主题，内容涉及公务礼仪、生活礼仪、职业礼仪、社交礼仪、涉外礼仪、公共文明礼仪等基本礼仪知识及时政热点，引导广大干部群众深入学习公共文明基本常识，在全区营造了浓厚的学习氛围。竞赛环节分两轮进行，由必答题、抢答题两种题型组成，参赛选手表现出色，尤其是在抢答题环节，选手们沉着冷静，思维敏捷，表达明快，场面既紧张又激烈，得到了现场观众的阵阵掌声。 在比赛活动休息期间，主持人与现场观众进行了问题互动，极大地激发了在座观众对讲文明重礼仪的热情，加深了对文明基本常识的理解和认识，为持续推动全区公共文明素养提升工程起到了积极作用。</span><br style=\"padding: 0px; margin: 0px; font-family: Simsun; font-size: 12px; line-height: 18px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"font-family: Simsun; font-size: 12px; line-height: 18px; background-color: rgb(255, 255, 255);\">&nbsp; 经过紧张激烈的竞赛，优秀的竞赛代表队脱颖而出，他们将代表高新区参加全市公共文明基本常识知识竞赛复赛和决赛。</span></p>', '2016-09-07 18:38:00', '99', '2016-09-07 18:40:02', '1', '0', '0', null, null, '2', '03', '99', '2016-09-07 18:40:02', '99', '2016-09-07 18:40:02', '0', '0');
INSERT INTO `t_city_district_notice` VALUES ('64', '市人大副主任、市总工会主席人到我区调研文体活动场馆选址及规划', '', null, '<p style=\"text-align: center;\">市人大副主任、市总工会主席等到我区调研文体活动场馆选址及规划</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; font-family: Simsun; font-size: 12px; line-height: 18px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;9月2日上午，市人大副主任、市总工会主席赵新中一行到我区就郑州市总工会在高新区建设文体活动场馆选址及规划情况进行调研。区党工委副书记、管委会常务副主任牛瑞华，区党工委委员、纪工委书记张良才，区党工委委员、管委会副主任王军陪同调研。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; font-family: Simsun; font-size: 12px; line-height: 18px; white-space: normal; background-color: rgb(255, 255, 255);\"><img src=\"/geekdol/hbridge/upload/image/20160907/1473244891555046898.png\" title=\"1473244891555046898.png\" alt=\"blob.png\"/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; font-family: Simsun; font-size: 12px; line-height: 18px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp;<span style=\"font-family: Simsun; font-size: 12px; line-height: 18px; background-color: rgb(255, 255, 255);\">赵新中主席一行实地查看了文体活动场馆的选址、规划等情况，区规划局负责人现场详细介绍了文体活动场馆的规划及周边区域等。</span><br style=\"padding: 0px; margin: 0px; font-family: Simsun; font-size: 12px; line-height: 18px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"font-family: Simsun; font-size: 12px; line-height: 18px; background-color: rgb(255, 255, 255);\">&nbsp; 下一步，郑州市总工会将对项目规划选址进行深入论证，做到科学规划。区党群工作部将加大协调力度，力争项目早落地、早建成，早日为全区职工群众提供高品质的文化场所，实实在在提升全区职工群众的幸福感和归属感。</span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; font-family: Simsun; font-size: 12px; line-height: 18px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp;</p><p><br/></p>', '2016-09-07 18:40:43', '99', '2016-09-07 18:44:20', '1', '4', '0', null, null, '2', '03', '99', '2016-09-07 18:41:58', '99', '2016-09-07 18:44:20', '8', '0');
INSERT INTO `t_city_district_notice` VALUES ('65', '枫杨办事处丁楼安置区（翰林国际城）启动交接仪式', '', null, '<p style=\"text-align: center;\">枫杨办事处丁楼安置区（翰林国际城）启动交接仪式</p><p>&nbsp; <span style=\"font-family: Simsun; font-size: 12px; line-height: 18px; background-color: rgb(255, 255, 255);\">9月6日，枫杨办事处丁楼安置区交房仪式正式启动，高新区党工委副书记李金勇、区人大工委副主任吴永昭、办事处主要负责人，丁楼村村两委及村民代表参加本次交接仪式。</span></p><p><span style=\"font-family: Simsun; font-size: 12px; line-height: 18px; background-color: rgb(255, 255, 255);\"><img src=\"http://www.zzgx.gov.cn/category/2005/2016/09/06/images/self_20160906_5.jpg\"/></span></p><p><span style=\"font-family: Simsun; font-size: 12px; line-height: 18px; background-color: rgb(255, 255, 255);\"><img src=\"http://www.zzgx.gov.cn/category/2005/2016/09/06/images/self_20160906_6.jpg\"/></span></p><p><span style=\"font-family: Simsun; font-size: 12px; line-height: 18px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: Simsun; font-size: 12px; line-height: 18px; background-color: rgb(255, 255, 255);\">&nbsp;从当初的丁楼村拆迁方案制定实施，到安置区规划建设，再到现在的群众回迁，高新区管委会、枫杨办事处、丁楼村委会、三德置业，共同付出了艰辛的努力。交房仪式上，丁楼村负责人分别对丁楼村安置房建设情况进行了详细介绍，开发商在本次交接仪式做了相关发言。会后，为让大家更直接地了解安置房建设情况，开发商组织全体人员到安置房现场参观、检查。</span><br style=\"padding: 0px; margin: 0px; font-family: Simsun; font-size: 12px; line-height: 18px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"font-family: Simsun; font-size: 12px; line-height: 18px; background-color: rgb(255, 255, 255);\">&nbsp; 此次安置房交接标志着丁楼城中村改造项目取得成功，下一步，枫杨办事处将用公平、公正、公开、透明的原则，确保分房工作顺利进行，并加快完善相关配套设施，让丁楼村村民早日回迁，早日入住。</span></span></p>', '2016-09-07 18:45:16', '99', '2016-09-07 18:46:21', '1', '2', '0', null, null, '2', '03', '99', '2016-09-07 18:46:21', '99', '2016-09-07 18:46:21', '2', '0');
INSERT INTO `t_city_district_notice` VALUES ('66', '“青春家园”八月工作汇报座谈会圆满举行', '', null, '<p style=\"text-align: center;\">“青春家园”八月工作汇报座谈会圆满举行<br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; font-family: Simsun; font-size: 12px; line-height: 18px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp; “青春家园”是由郑州高新区团委打造的青少年综合服务平台，目前枫杨办事处锦华苑、万丰慧城、荣邦城三个社区分别由彩虹社工和倾心社工负责实际运营管理。“青春家园”项目社区青少年为重点对象，立足社区青少年的需求，本着“专业、参与、互助、共享”的服务理念，开展专业社工服务，为其提供学习、娱乐和交流的平台，促进青少年参与社区互动，打造互助、包容、充满关爱的和谐社区。<br style=\"padding: 0px; margin: 0px;\"/>&nbsp; 2016年8月30日（周二）上午，围绕着“青春家园”青少年综合服务平台从7月中旬启动至今三个“青春家园”活动情况总结汇报为主题，举行了一场座谈会。区团委副书记、梧桐办事处盛世、春藤社区，枫杨办事处锦华苑、万丰慧城、荣邦城社区五个社区的主任参加会议。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; font-family: Simsun; font-size: 12px; line-height: 18px; white-space: normal; background-color: rgb(255, 255, 255);\"><img src=\"http://www.zzgx.gov.cn/category/2005/2016/08/30/images/self_20160830_14.jpg\"/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; font-family: Simsun; font-size: 12px; line-height: 18px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp;&nbsp;<span style=\"font-family: Simsun; font-size: 12px; line-height: 18px; background-color: rgb(255, 255, 255);\">其中，“青春家园”荣邦城站随着活动的开展，确定了国学教育系列和生命教育系列两个小组活动，同时以服务型为主的社区活动来进行“青春家园”的宣传工作，使更多居民了解“青春家园”，并积极参与到服务中去。“青春家园”锦华苑站在每周固定的“巧手动起来”、“听56朵花开的声音”、“百家小讲坛，分享小故事”“舞动青春”和“影院嗨起来”等活动之外，还筹办了暑期夏令营，同时，在朝阳读书会活动基础上，开展成语故事情景剧系列活动，接下来将举办四点半课堂的开课仪式筹备以及联合荣邦城站举办中秋节亲子活动及教师节学校宣传活动。“青春家园”万丰慧城站是由倾心社工负责实际活动的，于7月中旬在三个社区的“青春家园”启动朝阳读书会读书活动，在此基础上，开展了诸如“情系中华少年&nbsp; 弘扬国学万化”、“经典同品书香溢&nbsp; 国学共扬华夏兴”“国学经典只是竞答”等弘扬传统文化国学精典的文化类活动，同时还组织了例如“绿植置换”“跳蚤市场”“小区儿童文艺汇演”“手影展示”“良辰美景，为你庆生——社区青少年生日派对”等众多深受孩子们喜闻乐见的活动，深受社区广大居民的喜爱。9月份将启动为期21天的打卡的国学活动。</span><br style=\"padding: 0px; margin: 0px; font-family: Simsun; font-size: 12px; line-height: 18px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"font-family: Simsun; font-size: 12px; line-height: 18px; background-color: rgb(255, 255, 255);\">&nbsp; “青春家园”活动的开展不仅丰富了我区青少年的业余生活，同时也扩大了共青团的号召力和影响力。社区居民也从一开始的对活动抱有戒心和不能太信任到现在积极参与，踊跃报名。社区物业也从一开始的防备心理，不让张贴海报宣传，发放宣传彩页，到现在积极配合“青春家园”社工的工作。</span><br style=\"padding: 0px; margin: 0px; font-family: Simsun; font-size: 12px; line-height: 18px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"font-family: Simsun; font-size: 12px; line-height: 18px; background-color: rgb(255, 255, 255);\">&nbsp; 目前，高新区“青春家园”各站点的各个项目工作都在如火如荼的开展中。区团委副书记和枫杨办事处各社区主任针对社工工作出现的不足之处提出了建议，对社工工作中出现的困难，如网络信号不好，前台等及时给予了回应并表示高度重视，下一步将协商各方力量，给出解决方案，争取尽快解决社工们提出来的工作困难。会议沟通了各方意见，最终圆满结束。</span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; font-family: Simsun; font-size: 12px; line-height: 18px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp;</p><p><br/></p>', '2016-09-07 18:47:32', '99', '2016-09-07 18:48:56', '1', '11', '0', null, null, '2', '03', '99', '2016-09-07 18:48:56', '99', '2016-09-07 18:48:56', '11', '0');
INSERT INTO `t_city_district_notice` VALUES ('67', '关于招募春藤路居住区级市民服务中心建设运营合作方的公告', '', null, '<p style=\"padding: 0px;margin-top: 0px;margin-bottom: 10px;line-height: 35px;font-family: Arial;font-size: 18px;white-space: normal;text-indent: 2em;background-color: rgb(255, 255, 255)\"><span style=\"font-family: 宋体, SimSun;\">关于招募春藤路居住区级市民服务中心建设运营合作方的公告</span></p><p>&nbsp; 按照《郑州市人民政府办公厅关于印发郑州市“三级三类”市民服务中心规划建设指导意见的通知》（郑政办〔2015〕90号）要求，根据郑州高新区管委会有关工作安排，现发布招募春藤路居住区级市民服务中心建设运营合作方的公告。</p><p>项目名称：郑州高新区梧桐办事处春藤路市民服务中心</p><p>主 办 方：郑州高新区梧桐办事处</p><p>项目地址：郑州高新区升龙又一城D区</p><p>合作原则：坚持市场化运作的理念，充分发挥政府主导、市场主体的作用，通过政策推动、资源整合等措施，创新合作方式，引导各方参与到服务设施的开发建设、运营管理之中，实现多方参与、互利共赢。（节自郑政办〔2015〕90号文）</p><p>合作方式：合作方根据“郑州市“三级三类”市民服务中心规划建设指导意见”和郑州高新区梧桐办事处主体思路，自主投资、自主设计、建设、运营，政府监督落实“准入退出监督机制”。</p><p><br/></p>', '2016-09-08 09:19:26', '99', '2016-09-08 09:20:29', '0', '1', '0', null, null, '1', '04', '99', '2016-09-08 09:20:29', '99', '2016-09-08 11:43:22', '3', '1');
INSERT INTO `t_city_district_notice` VALUES ('68', '关于学习舞钢市“红色补贴”被侵占典型案例的通知', '', null, '<p style=\"text-align: center;\">关于学习舞钢市“红色补贴”被侵占典型案例的通知</p><p>办事处各部门、各村、社区：</p><p>&nbsp; &nbsp; 为进一步营造廉政文化的浓厚氛围，增强机关党员干部廉洁从政意识，预防职务犯罪案件的发生，现将舞钢市“红色补贴”被侵占案件链接公布如下，望各部门、各村、社区及时、认真阅读，引以为戒，并做好自身检查，堵塞制度漏洞，避免发生类似事件!</p><p>链接：csr.mos.gov.cn/content/2015-11/12/content_19204.htm</p><p><br/></p>', '2016-09-08 09:22:57', '99', '2016-09-08 09:44:53', '1', '9', '0', null, null, '1', '04', '99', '2016-09-08 09:23:31', '99', '2016-09-08 09:44:53', '13', '0');
