INSERT INTO `t_city_district_notice` VALUES ('70', '郑州市\"书香之家”申请通知', '', null, '<p style=\"padding: 0px; margin-top: 0px; margin-bottom: 10px; line-height: 35px; font-family: Arial; font-size: 18px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp; &nbsp;</p><p>&nbsp; 接区文管办通知，现在办事处辖区内进行“书香之家”推选，请有意向的办事处员工及辖区内居民积极报名参加，推荐成功后每年将对“书香之家”获得家庭发放专项资金。</p><p>&nbsp; 咨询电话：67759118</p><p>&nbsp; 详细情况请参考附件。</p><p>附件：</p><p>1、标准Uploads/attachs/2015/12/08/20151208_044410_146.doc</p><p>2、申请表Uploads/attachs/2015/12/08/20151208_044614_137.doc</p><p>&nbsp;</p><p><br/></p>', '2016-09-08 09:25:25', '99', '2016-09-08 09:26:01', '1', '6', '0', null, null, '1', '04', '99', '2016-09-08 09:26:01', '99', '2016-09-09 11:38:02', '7', '1');
INSERT INTO `t_city_district_notice` VALUES ('71', '关注计生 关注民生', '', null, '<p>&nbsp; 为进一步学习领会河南省新的人口和计划生育条例，枫杨社区计生办召开了全体计生管理人员会议，计生专干参加了本次会议。</p><p>&nbsp; 会上计生办领导为大家解读了2016年5月27日河南省第十二届人民代表大会常务委员会第二十二次会议修订后的条例，要求所有计生管理人员要认真领会新条例，将计生工作做到更贴近居民生活。着重指出下一步计生工作重点在提倡优生优育，做好优生优育宣传，要鼓励公民进行婚前医学检查，提高人口质量。</p>', '2016-09-08 09:31:33', '99', '2016-09-08 09:34:43', '1', '6', '0', null, null, '1', '04', '99', '2016-09-08 09:32:09', '99', '2016-09-08 09:34:43', '8', '0');
INSERT INTO `t_city_district_notice` VALUES ('72', '微信公众号开通', '', null, '<p>&nbsp; 微信公众号现在已经成为我们现代人不可缺少的一部分，枫杨办事处在2015年6月推出办事处微信公众号后，已经成为辖区居民日常生活的“可移动的信息中心”。</p><p>&nbsp; 2016年3月，枫杨办事处微信公众号推出网格服务板块，通过网格实现方便群众办事的目的，拓展群众参与网格化社会管理渠道，有效提升了基层服务管理水平，达到了网格化管理“横到边、纵到底、无缝隙，全覆盖”的目标。</p><p><br/></p>', '2016-09-08 09:40:15', '99', '2016-09-08 09:40:23', '1', '3', '0', null, null, '1', '04', '99', '2016-09-08 09:40:23', '99', '2016-09-08 09:40:23', '3', '0');
INSERT INTO `t_city_district_notice` VALUES ('73', '枫杨办事处社区居委会积极开展“朝阳读书会”活动', '', null, '<p style=\"text-align: center;\">枫杨办事处社区居委会积极开展“朝阳读书会”活动</p><p>&nbsp; 为了丰富社区青少年的暑期文化生活，增强青少年课外学习的积极性，7月14日，荣邦城社区和万丰慧城社区联合倾心社工志愿者在社区居委会图书室&nbsp;共同举办社区青少年的“朝阳读书会”活动。</p><p><img src=\"/geekdol/hbridge/upload/image/20160908/1473298933493055950.png\" title=\"1473298933493055950.png\" alt=\"blob.png\"/> &nbsp; 通过准备和宣传，上午9点，“朝阳读书会”分别在荣邦城社区和万丰慧城社区如期举行。社区多名青少年学生在家长的带领下陆陆续续来到社区图书室参加“朝阳读书会”活动，同学们在图书室里找到了自己喜欢的书籍，和同来参加活动的同伴们交流的很愉快，大家相互介绍自己喜欢的书籍，一起分享知识大餐。活动的最后，针对每个读书的小朋友，都会有志愿者对他们进行读书学习辅导，孩子们获益匪浅，读书活动效果良好。</p><p>&nbsp; 通过本次读书活动，孩子们了解了更多的知识，增进了彼此的友谊，拉近了居民与社区之间的距离，为青少年健康成长营造了良好的社区环境，进一步推进了社区文化建设。</p><p><br/></p>', '2016-09-10 09:43:30', '99', '2016-09-08 09:43:35', '1', '5', '0', null, null, '1', '04', '99', '2016-09-08 09:43:35', '99', '2016-09-08 09:43:35', '5', '0');
INSERT INTO `t_city_district_notice` VALUES ('74', '变废为宝，珍爱环境', '', null, '<p>&nbsp; 为鼓励社区居民爱护现有环境，让他们深刻的体会到人人都可以做环保达人，生活中的小东西也有大作用，7月28日，一场以废旧物品换绿色植物的活动走进荣邦城社区，倡议大家关注环保、珍爱环境。</p><p>&nbsp; 通过社区工作人员与倾心社工们充分的前期宣传，大大提高了居民的知晓率，活动还未开始，就有大量居民拿着家中不用的废旧书籍、杂志、报纸等在活动现场等候。下午五时许，活动正式开始，工作人员按照活动规则：3本书换一个盆栽，2本书换一个花盆，1本书换一盒抽纸等，依次为居民置换物品，绿色植物尤其受欢迎，很快工作人员购买的多肉、滴水观音等多种盆栽就被居民们置换一空。居民们纷纷表示：“绿色当铺”活动在变废为宝的同时又能减少资源浪费、保护生态环境，让居民形成人人关注环保的和谐氛围。截至活动结束，共换得图书200余册，废旧报纸百十斤，同时，工作人员表示对回收的物品会进行整理、分类，为废旧物品合适的安放位置。</p>&nbsp; 此次活动主要是通过以旧换绿的方式让居民们了解到废旧物品的价值，增强他们收集可再生垃圾并且二次利用的意识，低碳环保，追求时尚绿色新生活，也为打造绿色社区奉献一份力量。<p><br/></p>', '2016-09-08 09:46:33', '99', '2016-09-08 09:48:12', '1', '7', '0', null, null, '1', '04', '99', '2016-09-08 09:48:12', '99', '2016-09-08 09:48:12', '7', '0');
INSERT INTO `t_city_district_notice` VALUES ('75', '枫杨办事处开展消防安全检查工作', '', null, '<p>&nbsp; 为进一步落实火灾防控工作，切实加强居民住宅楼消防安全管理，枫杨办事处联合高新区消防大队深入住宅居民楼开展消防安全检查工作，督促火患整改，普及消防安全知识。</p><p>&nbsp; 检查针对辖区内翠竹苑、西现代城、锦华苑、金盾花园等重点社区查看居民小区安全出口、疏散通道是否堵塞，消防车通道设置是否符合规定，是否保持畅通，消防设施、器材是否保持完好有效，消防安全管理制度、灭火和应急疏散预案是否落实，是否存在违法搭建建筑占用防火间距、影响人员逃生和灭火救援等情况。针对检查发现的消防隐患，检查组当场填写了《责令整改通知书》，要求物业要在规定时限内整改，限期未整改的，将按照《中国人民共和国消防法》予以相关处罚。</p><p>&nbsp; 检查结束后，办事处相关负责人向社区物业管理人员和居民发放消防宣传知识手册和宣传挂图等宣传资料，并对物业管理员强调，要加大并落实消防安全管理工作，及时发现工作中存在的薄弱环节，以免发生火灾造成严重后果。</p><p><br/></p>', '2016-09-08 09:50:06', '99', '2016-09-08 09:51:01', '1', '28', '0', null, null, '1', '04', '99', '2016-09-08 09:51:01', '99', '2016-09-08 09:51:01', '28', '0');
