INSERT INTO `t_city_district_notice` VALUES ('157', '“平语”近人——习近平谈中国人民抗日战争', '', null, '<p><span style=\"color: rgb(5, 1, 0); font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; font-size: 14px; line-height: 36px; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;中国人民抗日战争胜利，是近代以来中国抗击外敌入侵的第一次完全胜利。这一伟大胜利，彻底粉碎了日本军国主义殖民奴役中国的图谋，洗刷了近代以来中国抗击外来侵略屡战屡败的民族耻辱。这一伟大胜利，重新确立了中国在世界上的大国地位，使中国人民赢得了世界爱好和平人民的尊敬。这一伟大胜利，开辟了中华民族伟大复兴的光明前景，开启了古老中国凤凰涅槃、浴火重生的新征程。经历了战争的人们，更加懂得和平的宝贵。我们纪念中国人民抗日战争暨世界反法西斯战争胜利70周年，就是要铭记历史、缅怀先烈、珍爱和平、开创未来。</span></p>', '2016-09-18 15:45:39', '108', '2016-09-18 15:47:17', '1', '5', '0', null, null, '2', '03', '108', '2016-09-18 15:46:51', '108', '2016-09-18 15:47:17', '6', '0');
INSERT INTO `t_city_district_notice` VALUES ('158', '三个“首次”凸显李克强美洲之行不一般', '', null, '<p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">特稿：三个“首次”凸显总理美洲之行“不一般”</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　——李克强总理出席第71届联大系列高级别会议并对加拿大、古巴进行正式访问前瞻</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　国务院总理李克强将于9月18日至28日赴纽约联合国总部出席第71届联合国大会系列高级别会议，并对加拿大和古巴进行正式访问。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　亲睦远朋，运筹多边；深化传统友谊，推动全球治理。李克强总理美洲之行展现中国特色大国外交丰富光谱，聚焦世界关注目光。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　三个“首次”，凸显总理此行“不一般”。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　<strong>首次登上联大讲台 中国方案备受期待</strong></p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　纽约曼哈顿东河之滨的联合国总部，进入一年中最繁忙时节。当地时间9月13日，第71届联合国大会正式开幕，来自联合国193个会员国代表汇聚于此。面对2030年可持续发展议程、气候变化《巴黎协定》的执行重任，面临恐怖主义、难民危机、逆全球化潮流等全球性挑战，作为联合国常任理事国与最大发展中国家的中国，将为推动世界和平、促进共同发展、完善全球治理提出怎样的方案和路径？</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　国际新形势与中国重返联合国45周年纪念的“叠加”，使李克强总理在联大的首次亮相备受关注。一场在联大一般性辩论发表讲话的“重头戏”，一场落实2030年可持续发展议程座谈会，两场难民问题会议，数场双边会见……总理的“联合国时间”安排得满满当当。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　“习近平主席去年出席联合国成立70周年系列峰会期间提出了一系列支持联合国的承诺和举措，李克强总理将宣布这些承诺和举措的后续落实情况。”中国国际问题研究院研究员杨希雨认为，李克强总理的联合国之行既有延续性意义，也有新意义。“针对当前复杂多变的国际形势，总理将全面阐述中国外交政策和立场，这既是对联合国核心作用的支持，对世界更好了解中国、中国与世界更好沟通也是非常重要的实践。”</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　“客场中的主场外交”是李克强总理此行另一看点。出席联大会议期间，李克强总理将主持由中方倡议举行的落实2030年可持续发展议程座谈会，宣介中国发展成就和理念，提出推动全球发展事业新举措。此外，总理还将就地就近展开对美公共外交，与美国金融、智库、媒体等各界代表广泛接触，为中美关系理清方向、增进共识。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　“这样的活动安排，展现了中国新一代领导人开展公共外交的创新思路和战略思维。”杨希雨说。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　<strong>启动首次总理年度对话 中加关系迎来新时代</strong></p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　8月底，李克强总理刚刚在北京会见加拿大总理特鲁多，中加双方决定建立两国总理年度对话机制。此次访加，不仅是中国总理13年来首访“枫叶之国”，更是中加总理年度对话机制的启动之旅。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　中加总理在不到一个月的时间实现互访，一些媒体和分析家用“迅速回暖”形容当前的中加关系。即将启幕的中加总理首次年度对话，无论是会谈内容的广泛性还是会谈结果的质量都颇受关注，被认为是李克强总理访加的“核心看点”。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　访加期间，李克强总理将参加约20场主要活动。从渥太华到蒙特利尔，从政治会谈到经贸论坛再到人文交流，此访将全面推动中加政治互信、务实合作再上新台阶。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　加拿大财政部长比尔·莫诺将该国不久前正式申请加入亚投行的举动称为“最佳选择”。事实上，对中加两个经济大国而言，共同做大合作共赢的“蛋糕”同样是双方的“最佳选择”。中国是加拿大第二大贸易伙伴、第二大进口来源地和第二大出口市场。两国经济高度互补，高科技、农业、能源资源、第三方合作等领域合作潜力尤为巨大。特鲁多曾表示，加强两国关系，将能打开大门，为加拿大企业创造新的机会，也给中国企业带来在加拿大扩展的机会。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　“从全景的角度看，与德国、法国、加拿大等发达国家中的重要力量在不同领域、各有侧重地积极合作，表明中国正在巧妙地搭建一个良性互动、互利共赢的经济外交多极框架。”杨希雨说。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　<strong>中国总理首次正式访古 传统友谊再度升华</strong></p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　“加勒比明珠”古巴将迎来中古建交56年来首位正式到访的中国总理。哈瓦那大学教授鲁文·萨多亚称其为中古关系的“大事件”，期待李克强总理的到访为古巴带来“新的资金、技术以及与外部世界更紧密的联系”。</p><p><ins class=\"sinaads sinaads-done\" id=\"Sinads49447\" style=\"display: block; overflow: hidden; text-decoration: none;\"><ins style=\"text-decoration: none; margin: 0px auto; width: 300px; display: block; position: relative; overflow: hidden;\"><iframe width=\"300px\" height=\"250px\" frameborder=\"0\" src=\"http://x.jd.com/exsites?spread_type=2&ad_ids=362:5&location_info=0&callback=getjjsku_callback\" name=\"clickTAG=http%3A%2F%2Fsax.sina.com.cn%2Fmfp%2Fclick%3Ftype%3D3%26t%&amp;viewTAG=http%3A%2F%2Fsax.sina.com.cn%2Fmfp%2Fview%3Ftype%3D3%26t%%26userid%3D171.11.2.169_1471933185.641737%26viewlog%3Dfalse\"></iframe></ins></ins></p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　历经半个多世纪发展，中古传统友谊成熟稳固，“好朋友、好同志和好兄弟”成为两国关系最恰如其分的写照。当前，古巴着力经济模式更新，同时外交呈现多元化趋势，对中国更加看重，中古关系面临发展新机遇。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　访古期间，李克强总理将出席古巴国务委员会主席兼部长会议主席劳尔·卡斯特罗举行的欢迎仪式，就双方共同关心的问题交换意见。双方预计签署近30项合作文件，涉及经济技术、融资、产能合作、质检、环保等诸多领域。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　中国是古巴第二大贸易伙伴，古巴是中国在加勒比地区第一大贸易伙伴。在中国社科院拉美所研究员徐世澄看来，中古经贸关系虽然发展较快，但从整个拉美和加勒比地区看，体量不是很大。“古巴政府和人民非常希望，李克强总理此访将有力推动中古经贸关系强劲发展。”</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　2015年李克强总理首访拉美，提出推进中拉产能合作“3×3”新模式。目前，中国企业正积极参与古巴圣地亚哥港改扩建工程等项目建设。“古巴制造业和基础设施比较落后，非常需要中国的机器、设备和人员支持，中古产能合作大有可为。”徐世澄说。(记者 郝薇薇 尚军 刘彬)</p><p class=\"article-editor\" style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; text-align: right; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">责任编辑：王浩成</p><p><br/></p>', '2016-09-18 15:50:50', '108', '2016-09-18 15:52:16', '1', '7', '1', '2016-09-18 15:51:19', '2016-09-19 15:51:23', '2', '03', '108', '2016-09-18 15:52:16', '108', '2016-09-18 16:41:15', '8', '0');
INSERT INTO `t_city_district_notice` VALUES ('159', '因涉及贿选452人辞去辽宁省人大代表', '', null, '<p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">记者从辽宁省人大获悉，9月17日，辽宁省人大十二届七次会议筹备组发出公告：日前，沈阳等14个市人大常委会和有关选举单位决定接受涉及贿选案的丁坤等452人，辞去辽宁省第十二届人民代表大会代表职务，另有李峰代表职务被罢免，此前因涉嫌严重违纪被立案调查的吴野松辞去代表职务。以上454名省人大代表资格终止。目前辽宁省十二届人大实有代表147人。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　<strong>公告称：</strong></p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　<strong>辽宁省第十二届人民代表大会第一次会议选举全国人大代表过程中，有45名当选的全国人大代表拉票贿选，有523名辽宁省人大代表涉及此案。日前，沈阳等14个市人大常委会和有关选举单位决定接受涉案的丁坤等452人辞去辽宁省第十二届人民代表大会代表职务，阜新市人大常委会决定罢免李峰的辽宁省第十二届人民代表大会代表职务，其他涉案代表有的已经在此前辞去代表职务，有的已调离本行政区，代表资格已经终止。铁岭市人大常委会决定接受吴野松辞去辽宁省第十二届人民代表大会代表职务。</strong>依照《中华人民共和国全国人民代表大会和地方各级人民代表大会代表法》的有关规定，以上454名辽宁省第十二届人民代表大会代表的代表资格终止。依照《中华人民共和国全国人民代表大会和地方各级人民代表大会选举法》的有关规定，其中108人的辽宁省第十二届人民代表大会常务委员会组成人员职务、辽宁省第十二届人民代表大会专门委员会组成人员职务相应终止。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　鉴于辽宁省十二届人大常委会62人中有38人涉案，已不足半数，</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　9月13日，十二届全国人大常委会第二十三次会议决定成立辽宁省十二届人大七次会议筹备组，负责筹备辽宁省十二届人大七次会议的相关事宜。根据全国人大常委会的决定，筹备组是代行省人大常委会部分法定职权的临时性机构，负责筹备并召集省人民代表大会，办理省人大代表辞职后的备案、公告，代表补选后的资格确认等事项。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　辽宁省人大十二届七次会议筹备组会议决定，省十二届人大七次会议将于11月1日召开，届时将补选省人大代表。筹备组认为，补选好省人大代表，不仅是对辽宁深刻吸取拉票贿选案教训、坚决与中央保持高度一致的政治检验，也是净化和营造良好政治生态的重要契机，更是优化代表结构、提高代表素质、改进人大工作、重塑人大形象的难得机遇。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　辽宁拉票贿选案是新中国成立以来查处的第一起发生在省级层面、严重违反党纪国法、严重违反政治纪律和政治规矩、严重违反组织纪律和换届纪律、严重破坏党内选举制度和人大选举制度的重大案件。涉案人数众多、性质恶劣、情节严重，触目惊心。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　记者统计发现，此次被终止的代表名单至少有6人是副省级领导干部，多名正厅级干部，有不少还是现任职务，还有数十位省内著名企业家。对拉票贿选案的处理，对这些代表资格的终止，充分体现了党中央对拉票贿选“零容忍”的坚定决心，体现了辽宁省委对中央精神和部署的坚决贯彻。</p><p><br/></p>', '2016-09-18 16:00:33', '108', '2016-09-18 16:27:58', '1', '5', '0', null, null, '57', '03', '108', '2016-09-18 16:01:47', '108', '2016-09-18 16:27:58', '6', '0');
INSERT INTO `t_city_district_notice` VALUES ('160', '美国纽约爆炸已致29人受伤 市长表示和恐袭无关', '', null, '<p><img src=\"/geekdol/hbridge/upload/image/20160918/1474186103777099564.jpg\" title=\"1474186103777099564.jpg\" alt=\"_KWB-fxvyqwa3366368.jpg\"/><img src=\"/geekdol/hbridge/upload/image/20160918/1474186108815072006.jpg\" title=\"1474186108815072006.jpg\" alt=\"zOOj-fxvyqwa3366357.jpg\"/></p>', '2016-09-18 16:07:26', '108', '2016-09-18 16:16:51', '1', '6', '1', '2016-09-18 16:16:40', '2016-09-19 16:16:44', '2', '03', '108', '2016-09-18 16:08:50', '108', '2016-09-18 16:16:51', '7', '0');
INSERT INTO `t_city_district_notice` VALUES ('161', '吉林男子蒙冤18年申请1900余万赔偿 法院受理', '', null, '<p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal; widows: 1;\">　新华社长春9月18日电（记者 周立权）18年来3次被判死缓终被改判无罪的<a href=\"http://news.sina.com.cn/o/2016-05-26/doc-ifxsqtya6080296.shtml\" target=\"_blank\" style=\"color: rgb(17, 62, 170); text-decoration: none;\">刘吉强</a>，向吉林省高级人民法院递交了国家赔偿申请书，总计要求赔偿1937万余元。日前，吉林省高级人民法院正式立案受理其赔偿申请。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal; widows: 1;\">　　记者了解到，申请人刘吉强提出，自1998年2月16日至2016年4月29日，被剥夺人身自由18年多，总计6647天。故要求赔偿侵犯人身 自由赔偿金、精神损害抚慰金、社会保障金、健康赔偿金等共计1937万余元。除《中华人民共和国国家赔偿法》规定的侵犯人身自由赔偿金、精神损害抚慰金 外，刘吉强还要求赔偿社会保障金和一次性安置费等费用。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal; widows: 1;\">　　在侵犯人身自由赔偿金方面，刘吉强提出应按每日24小时计算，而非国家所规定的以每日工作8小时计算。　　1998年2月14日情人节傍晚，吉林市27岁的女子郭某被杀死于家中。经吉林市公安局船营分局侦查认定，郭某时年34岁的朋友刘吉强为凶手。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal; widows: 1;\">　　经吉林市人民检察院起诉，1999年12月，吉林市中级人民法院一审认定刘吉强犯故意杀人罪，判其死刑，缓期两年执行，刘吉强上诉。2000年3月，吉林省高级人民法院撤销原判决，认为此案事实不清，证据不足，发回重审。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal; widows: 1;\">　　2002年6月，吉林市人民检察院再次提起公诉。同年11月，吉林市中级人民法院再次判决，刘吉强又被判为死缓。刘吉强不服上诉，2003年3月，吉林省高级人民法院作出终审裁定，维持原判。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal; widows: 1;\">　　随后，刘吉强及家人开始了申诉之路。2015年7月，吉林省人民检察院向吉林省高级人民法院提出再审建议。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal; widows: 1;\">　　吉林省高级人民法院在复查此案后，于2015年12月作出再审决定。2016年4月19日，吉林省高级人民法院在吉林市依法公开再审此案。4月29日，法院判决认定，本案除刘吉强有罪供述外无其他证据证实其到过案发现场并实施杀人行为，故依法宣判刘吉强无罪。</p><p class=\"article-editor\" style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; text-align: right; line-height: 2em; font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal; widows: 1;\">责任编辑：孙爱林 SN146</p><p><br/></p>', '2016-09-18 16:44:08', '51', '2016-09-18 16:44:50', '1', '3', '1', '2016-09-18 16:44:39', '2016-09-19 16:44:41', '1', '04', '51', '2016-09-18 16:44:44', '51', '2016-09-18 16:44:50', '4', '0');
INSERT INTO `t_city_district_notice` VALUES ('162', '官方回应大妈在抚仙湖洗澡：情况属实已处理', '', '公安局', '<p>&nbsp; &nbsp;</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal; widows: 1;\">　　原标题：大妈在云南抚仙湖洗澡引热议 官方：情况属实已处理</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal; widows: 1;\">　　中新网昆明9月18日电 （记者 胡远航）针对近日网曝一<a href=\"http://news.sina.com.cn/s/pa/2016-09-17/doc-ifxvyqvy6576475.shtml\" target=\"_blank\" style=\"color: rgb(17, 62, 170); text-decoration: none;\">大妈在国家一类饮用水源地抚仙湖内洗澡</a>一事，云南省玉溪市澄江县抚仙湖管理局回应称：经调查问题属实，该局已组织人员加强巡查检查，并对负责该片区的监督员进行了处罚。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal; widows: 1;\">　　抚仙湖是中国蓄水量最大的深水型淡水湖泊，也是国内为数不多的Ⅰ类水质淡水湖，拥有全国9.16%的淡水湖泊蓄水量，和91.4%的全国湖泊Ⅰ类水。近年来，随着抚仙湖景点的走热，越来越多的人慕名来到抚仙湖游泳避暑，不文明行为也屡有曝出。</p><p><br/></p>', '2016-09-18 16:47:00', '51', '2016-09-18 16:50:25', '1', '7', '1', '2016-09-18 16:47:29', '2016-09-19 16:47:46', '1', '04', '51', '2016-09-18 16:47:47', '51', '2016-09-18 16:51:05', '11', '0');
