INSERT INTO `t_city_district_notice` VALUES ('166', '温家宝今日现身湖北大悟一中(图)', '', null, '<p><img title=\"1474196438976036007.jpg\" alt=\"vVR3-fxvyqvy6657570.jpg\" src=\"/geekdol/hbridge/upload/image/20160918/1474196438976036007.jpg\"/>&nbsp;&nbsp;&nbsp; <span style=\"color: rgb(0, 0, 0); font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; font-size: 16px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 32px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none;\">　#长江日报快讯# 今天（9月18日）下午，有网友拍图称前国务院总理温家宝先后出现在孝感北站、大悟县第一中学。长江日报记者随后与大悟一中取得联系，对方称不便透露相关信息。大悟县政府相关工作人员向记者透露，温家宝确实于今日抵达大悟，但是否会如网友所言今晚住在大悟一中并不清楚。（长江日报记者 耿尕卓玛）</span></p>', '2016-09-01 18:59:12', '108', '2016-09-18 19:00:47', '1', '1', '0', null, null, '2', '03', '108', '2016-09-18 19:00:01', '108', '2016-09-18 19:00:47', '2', '0');
