INSERT INTO `t_village_notice` VALUES ('51', 'dfdsfdsf', null, '<p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211403591600000.jpg\" title=\"DSC_0937_副本.jpg\" height=\"429\" width=\"650\"/><br/></p><p style=\"white-space: normal;\">洛阳牡丹会开，看国色天香（图）</p><p style=\"white-space: normal;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;----洛阳赏牡丹，详细攻略</p><p style=\"white-space: normal;\">&nbsp; 每年的四月初，都是洛阳牡丹花会的时节，只有亲自看过牡丹的人们，才会领略到什么叫做“花中之王”。“国色天香真牡丹”看牡丹是一件赏心悦目的事情，洛阳人对牡丹的热爱，是从骨子里发出来的真心喜欢。就如刘禹锡诗《赏牡丹》中所言：“唯有牡丹真国色，花开时节动京城。”因此，总是觉得要到洛阳旅游，要赶在牡丹花开的时候，不仅是为了看牡丹，也为了感受洛阳人对牡丹的热情，而现在正是牡丹花开的时节！</p><p style=\"white-space: normal;\">&nbsp;去洛阳一定要搞清楚去那个公园欣赏牡丹，一般来说，洛阳王城公园是历届牡丹花会的主会场，这个时候往往人比花还多，但其实洛阳还有很多公园开园欣赏牡丹。建议观赏牡丹的游客，如果无需在洛阳城内停驻太长时间，而是通过以合理的安排，既满足观赏的需要，也满足整个游程的旅游计划。因为这个时候就可以理解什么是“洛阳纸贵”了，呵呵。</p><p style=\"white-space: normal;\">&nbsp; 牡丹之所以美，之所以珍贵，其中的一个原因就在于牡丹开花时间并不长，近年来，洛阳的一些公园开始培育一些晚开的牡丹花，令其花期可延长至“五一”旅游黄金周，因此五一时也有可能观赏到牡丹。但是到那时，早已经没有了满城花开的气氛了。</p><p style=\"white-space: normal;\">　　其实，去洛阳看牡丹，哪个地方的牡丹最好看，这要看你什么时候去洛阳了。如果是在四月上旬，建议去中国国花园和王城公园；四月下旬及五一的话去邙山上的国家牡丹园、国际牡丹园等地；四月中旬的话，下面推荐的几个牡丹园一般都可以：</p><p style=\"white-space: normal;\">&nbsp; 1、洛阳国色牡丹园：位于机场路与310国道交叉口西1.5公里处，占地440余亩，牡丹观赏面积160亩，品种550多个，30余万株，晚开品种50多个，花期可延长到5月10日左右。乘51路、83路公交车可达。</p><p style=\"white-space: normal;\">&nbsp; 2、洛阳王城公园：公交线路：101路，102路，103路，9路，10路，11路，15路，19路，40路，50路，59路。（王城公园站下车）可从火车站乘坐路到王城公园下车。(沿途的大站有火车站、百货楼、市中心医院、王城公园等)在中州路上还可以乘车9、101、59、19、15路到王城公园下车。开放时间：5:00-20:30</p><p style=\"white-space: normal;\">&nbsp; 3、西苑公园：位于河南洛阳的南昌路、九都西路、丽新路交汇处。可以从火车站或百货楼乘坐乘坐公交车到西苑公园站下车。</p><p style=\"white-space: normal;\">&nbsp; 而我去的是“中国国花园”。因为这一条线路有很多旅游景点，最著名的就是关林和龙门石窟了。</p><p style=\"white-space: normal;\">&nbsp; 4、中国国花园：从火车站前乘81路、53路公共汽车均可达龙门石窟。参观龙门石窟最好上午去。因为上午阳光直照石窟西山，光线充足，便于摄影。参观完龙门石窟从南边的漫水桥过去在对岸远眺石窟，然后参观东山石窟，出来后参观香山寺、白园。这样下来整个景区参观时间约为4-5小时。</p><p style=\"white-space: normal;\">&nbsp; 在回来的路上游览关林，最后前往中国国花园，这个时候时间虽然晚了点，但是避开了喧嚣的人群，可以逍遥自在的欣赏牡丹了。</p><p style=\"white-space: normal;\">河南洛阳</p><p style=\"white-space: normal;\">　门票：各大赏花点可以视花期和品种有选择性地去，去上两三个，花100元以内可以搞定。</p><p style=\"white-space: normal;\">&nbsp;交通：很多城市都有到达洛阳的火车和高铁，洛阳也有飞机场，很方便。</p><p style=\"white-space: normal;\">&nbsp;住宿：一般牡丹盛开时节，洛阳的住宿价格疯涨。但是也有200元左右的可供选择，大家来这里最好要提前预定酒店，如果预订不上也没关系，身为旅游城市的洛阳还是有很多小旅馆和招待所的。推荐：洛阳西雅图大酒店，洛阳雅香国际（公寓）大酒店这里不仅位于繁华的市中心，而且王城公园非常近，交通也很便利。</p><p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211403394412500.jpg\" title=\"1_副本.jpg\" height=\"675\" width=\"450\"/></p><p style=\"white-space: normal;\">洛阳牡丹花什么时候开放？<br/></p><p style=\"white-space: normal;\">　　早开品种初花期在4月9日左右，盛花期在4月13日左右；</p><p style=\"white-space: normal;\">　　中开品种4月11日左右初开，4月16日左右盛开；</p><p style=\"white-space: normal;\">　　晚开品火爆农资招商网种大约4月17日初开，盛花期在4月21日左右。</p><p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211403398475000.jpg\" title=\"9_副本.jpg\" height=\"675\" width=\"450\"/></p><p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211403403475000.jpg\" title=\"10_副本.jpg\" height=\"433\" width=\"650\"/></p><p style=\"white-space: normal;\">牡丹真的是太美了，从远处看，花瓣叠叠层层，仿佛在画的海洋中掀起了层层涟漪。</p><p style=\"white-space: normal;\">从近处看，花瓣细腻修长，花蕊泛着清淡的色彩，光影看上去都是那么的自然 和谐。</p><p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211403407381250.jpg\" title=\"11_副本.jpg\" height=\"433\" width=\"650\"/></p><p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211403420662500.jpg\" title=\"12_副本.jpg\" height=\"433\" width=\"650\"/></p><p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211403442850000.jpg\" title=\"13_副本.jpg\" height=\"433\" width=\"650\"/></p><p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211403457537500.jpg\" title=\"14_副本.jpg\" height=\"434\" width=\"650\"/></p><p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211403471287500.jpg\" title=\"15_副本.jpg\" height=\"433\" width=\"650\"/></p><p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211403487068750.jpg\" title=\"16_副本.jpg\" height=\"673\" width=\"450\"/></p><p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211403508475000.jpg\" title=\"17_副本.jpg\" height=\"430\" width=\"650\"/></p><p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211403515975000.jpg\" title=\"18_副本.jpg\" height=\"425\" width=\"650\"/></p><p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211403525037500.jpg\" title=\"19_副本.jpg\" height=\"430\" width=\"650\"/></p><p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211403533006250.jpg\" title=\"20_副本.jpg\" height=\"431\" width=\"650\"/></p><p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211403550037500.jpg\" title=\"21_副本.jpg\" height=\"658\" width=\"450\"/></p><p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211403558318750.jpg\" title=\"22_副本.jpg\" height=\"430\" width=\"650\"/></p><p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211403598006250.jpg\" title=\"2_副本.jpg\" height=\"433\" width=\"650\"/></p><p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211404012381250.jpg\" title=\"3_副本.jpg\" height=\"433\" width=\"650\"/></p><p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211404019412500.jpg\" title=\"4_副本.jpg\" height=\"433\" width=\"650\"/></p><p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211404029881250.jpg\" title=\"5_副本.jpg\" height=\"433\" width=\"650\"/></p><p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211404036287500.jpg\" title=\"6_副本.jpg\" height=\"433\" width=\"650\"/></p><p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211404044256250.jpg\" title=\"7_副本.jpg\" height=\"675\" width=\"450\"/></p><p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211404057381250.jpg\" title=\"8_副本.jpg\" height=\"675\" width=\"450\"/></p><p style=\"white-space: normal;\">洛阳牡丹花会门票价格：</p><p style=\"white-space: normal;\">　　1、神州牡丹园、王城公园(含动物园)：4月1日至4月8日早开期40元/人次，4月9日至4月25日盛花期50元/人次，4月26日至5月15日败落期40元/人次；</p><p style=\"white-space: normal;\">　　2、中国国花园：4月1日至4月8日早开期40元/人次，4月9日至4月25日盛花期50元/人次，4月26日至5月5日败落期00元/人次；</p><p style=\"white-space: normal;\">　　 3、隋唐遗址植物园：4月1日至4月8日早开期20元/人次，4月9日至4月25日盛花期40元/人次，4月26日至5月05日败落期20元/人次；</p><p style=\"white-space: normal;\">　　4、国家牡丹园：4月9日至4月30日盛花期50元/人次，5月01日至5月5日败落期40元/人次；</p><p style=\"white-space: normal;\">　　5、国际牡丹园：4月9日至5月3日盛花期50元/人次，5月4日至5月5日败落期20元/人次；</p><p style=\"white-space: normal;\">　　6、洛阳牡丹园、洛阳国花园：4月9日至4月30日早开期40元/人次，5月1日至5月5日败落期20元/人次。</p><p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal;\">中国国花园</p><p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211436026600000.jpg\" title=\"1.jpg\" height=\"429\" width=\"650\"/></p><p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211436043318750.jpg\" title=\"2.jpg\" height=\"429\" width=\"650\"/></p><p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211436065506250.jpg\" title=\"3.jpg\" height=\"429\" width=\"650\"/></p><p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211436082068750.jpg\" title=\"4.jpg\" height=\"429\" width=\"650\"/></p><p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211436099881250.jpg\" title=\"5.jpg\" height=\"429\" width=\"650\"/></p><p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211436124412500.jpg\" title=\"6.jpg\" height=\"429\" width=\"650\"/></p><p style=\"white-space: normal;\"><img src=\"http://img.lotour.net/Photo/201411/20141121/201411211436138631250.jpg\" title=\"7.jpg\" height=\"429\" width=\"650\"/></p><p style=\"white-space: normal;\">洛阳旅游：<br/></p><p style=\"white-space: normal;\">&nbsp; 地处中原地带的洛阳城内和周边还有很丰富的旅游资源，洛阳---郑州---开封，往西南方向可到达武当山，往西走可到西安和华山。甚至洛阳栾川的老君山、鸡冠洞、白云山、龙峪湾、重渡沟、寨沟风景区等等都是旅游爱好者，尤其是像我这样的户外爱好者喜欢的地方，因此，游洛阳，不是发愁该去哪里旅游，而是发愁该去的地方太多了，如果没有足够的时间，真是不知该如何选择为好。</p><p><br/></p>', '12e2ewqdwqdad', null, null, '2016-09-26 10:21:49', '0', '0', '0', null, null, '1', '2016-09-26 10:21:53', '1', '2016-09-27 15:45:40', '2', '0');
