  `delivery_mode` varchar(100) DEFAULT NULL COMMENT '配送方式:自取、物流名称',
  `logistics_number` varchar(100) DEFAULT NULL COMMENT '物流、快递名称',
  `phone` varchar(100) DEFAULT NULL COMMENT '商家电话',
  `freight` decimal(10,2) DEFAULT NULL COMMENT '物流运费',
  `order_close_reasons` varchar(255) DEFAULT NULL COMMENT '订单关闭理由',
  `ins_ymdhms` datetime DEFAULT NULL COMMENT '评定时间',
  `ins_id` bigint(20) DEFAULT NULL COMMENT '录入用户',
  `upd_id` bigint(20) DEFAULT NULL COMMENT '更新用户',
  `upd_ymdhms` datetime DEFAULT NULL COMMENT '更新时间',
  `upd_eac` bigint(20) DEFAULT NULL COMMENT '更新回数',
